known as khong_mtg\\n<wguo|mtg> jwl_home, cool stuff, thanks: )\\n* You are now known as wguo\\n* daclark_ (~daclark@dhcp-40-116.bne.redhat.com) has joined #erratadev\\n* jmcdonal_wfh is now known as jmcdonal_lunch\\n* sbaird-mtg is now known as sbaird-lunch\\n* daclark has quit (Ping timeout: 633 seconds)\\n<jwl_home> alas, I can\'t seem to find some of the sites I visited when I thought I\'d be going to BNE :-(  There were some really interesting ones, even better than that Brisbane page.\\n<jwl_home> I suspect you can do quite a bit of web-surfing with that link, though... found: http://www.createatour.com.au/country-hidden-gems-daytours.php\\n<jwl_home> that way.  Kind of \\\"make up your own tour\\\", with interesting starter ideas.\\n<wguo> yeah, then i guess one day is too short for so many charming places : )\\n<jwl_home> I think Green Mountain and/or Lamington National Park were what I was trying to recall for rainforest tours.\\n<jwl_home> but... yep, tons of possibilities.  I\'d go with something that seems the most fun for my mood (and the weather) at the time, but that\'s me. :)\\n<wguo> jwl_home, will picture fun thing then and show to you lol \\n* zxiong is now known as zxiong_brb\\n* You are now known as wguo|lunch\\n<jwl_home> wguo|lunch: sounds good to me, I love seeing good pictures!\\n<jwl_home> one last link before I head off for the night...\\n<jwl_home> \\\"O\'Reilly\'s Green Mountain Day Tour\\\" here sounded cool to me:  http://www.createatour.com.au/gold-coast-hinterland-daytours.php\\n<jwl_home> but even better if you can share the cost with some fellow adventurers\\n<jwl_home> there\'s even more stuff to choose from; but perhaps the Ultimate Tourists would have the best advice.\\n<jwl_home> (ultimate tourist == \\\"so much stuff to do, we had to move there!\\\" :-)\\n<jwl_home> Possible UMB issue: https://engineering.redhat.com/rt/Ticket/Display.html?id=445303\\n\",\"attribs\":\"*0|p+1iw*0+2m|1+1\"},\"pool\":{\"numToAttrib\":{\"0\":[\"aut