tch-branch errata-rails-rhel-6\\n\\nImport the new src rpm and update spec file\\nBetter make sure you have the latest commits:\\n\\ngit fetch && git reset --hard @{u}\\n\\nUse the src rpm from above:\\n\\nrhpkg import ~/rpmbuild/SRPMS/errata-rails-3.12.5-0.el6.src.rpm\\n\\nThe rhpkg import command should update and stage a few things ready to commit:\\n*sources\\n*The spec file, errata-rails-ruby2.spec\\n*.gitignore\\n\\nTake a look at the diff, (check that it looks right) then commit with a suitable commit message, then push.\\n\\ngit diff --staged\\ngit commit -m ‘Updates for 3.12.5-0 build’\\nrhpkg push\\n\\n(Test) Build\\nrhpkg build --scratch\\nBuild it\\nrhpkg build\\n\\n\",\"attribs\":\"*0*1+6*0|1+1*0*2*3*4+1*0|1+1b*0*2*3*4+1*0|1+2r*0*2*3*4+1*0+l*0*5+14*0|5+1v*0*6+1i*0|4+1h*0*6+1e*0|5+2q*0*6+o*0|1+1*0*6+f*0|1+1*0*6+13*0|5+2l*0*6+y*0|4+v*0*6+1r*0|3+29*0*2*3*4+1*0*1+7*0|1+1*0*2*3*4+1*0*1+12*0|1+1*0*2*3*4+1*0*1+a*0|4+33*0*6+h*0|1+1*0*6+16*0|1+1*0*6+a*0|3+f*0*6+l*0|2+a*0*6+b|2+2\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.UqJvMI7o2ytxEEOt\"],\"1\":[\"italic\",\"true\"],\"2\":[\"insertorder\",\"first\"],\"3\":[\"list\",\"bullet1\"],\"4\":[\"lmkr\",\"1\"],\"5\":[\"underline\",\"true\"],\"6\":[\"bold\",\"true\"]},\"nextNum\":7},\"head\":10,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:build_src_rpm:revs:0','{\"changeset\":\"Z:1>6k|5+6k$Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\",\"meta\":{\"author\":\"\",\"timestamp\":1499743943868,\"atext\":{\"text\":\"Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\\n\",\"attribs\