,\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1499243723228}}'),('pad:CentOS_7_virt-manager_authentication_failed:revs:5','{\"changeset\":\"Z:56>1|3=2o=2g*0|1+1$\\n\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1499243807829}}'),('pad:CentOS_7_virt-manager_authentication_failed:revs:6','{\"changeset\":\"Z:57>1|4=55*0|1+1$\\n\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1499243808326}}'),('pad:CentOS_7_virt-manager_authentication_failed:revs:7','{\"changeset\":\"Z:58>1|5=56*0|1+1$\\n\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1499243808827}}'),('pad:CHART_WITH_lkocman','{\"atext\":{\"text\":\".:lkocman:. what\'s PLP?\\n.:wguo:. sorry , Package List Process \\n.:wguo:. maitai project \\n.:lkocman:. oh you mean new package process\\n.:lkocman:. right\\n.:wguo:. yeah \\n.:lkocman:. perfect. What are the questions? I suppose that you\'re from HSS right?\\n.:wguo:. im form hss java team(beijing side) :)   \\n.:lkocman:. cool. I just met Chaobin in Brno (if you know him) seems like he\'s going to get few beers today with us\\n.:wguo:. cool , yeah , i know him    \\n.:wguo:. sent you a mail two days ago , have you received it ? \\n.:lkocman:. :-) You guys should really move here to brno. I\'ve heard that you\'re paying incredible money for rent/mortgage\\n.:wguo:. you mentioned some missing steps on the process for new package for RHEL-6\\n.:lkocman:. let me see\\n.:lkocman:. is your mail same as your irc nick?\\n.:wguo:. right \\n.:lkocman:. ah got it\\n.:wguo:. we really want to go there  : )\\n.:wguo:. if you guys can provide temp house for us   ,   haha \\n.:lkocman:. you can ask chaobin about how it works here :-)\\n.:lkocman:. :-) I\'m just renting a flat here\\n.:lkocman:. for about 11.8k CZK including all \\n.:lkocman:. it\'s 11800 / 3 in your money\\n.:wguo:. each month or ?\\n.:lkocman:. yep\\n.:wguo:. i think month \\n.:wguo:. cool \\n.:lkocman:. not so bad right?\\n.:wguo:. we all spend all of our money each month \\n.:lkocman:. :-) what do you mean?\\n.:wguo:. very cool  comparing beijing \\n.:lkocman:. yes I\'ve heard it\'s much more expensive\\n.:lkocman:. oh I see the ticket now\\n.:lkocman:. I didn\'t know about transformation to the new system\\n.:lkocman:. which sends us ticket\\n.:lkocman:. I can tell you what\'s the problem in current system\\n.:wguo:. ok , \\n.:lkocman:. maitai fires ticket, but doesn\'t check for a state. So it\'s cool that it\'s async but developer is in fact blocked until I\'ll resolve mine\\n.:lkocman:. so it would be really nice if he would be blocked untill the \\\"package in buildsystem\\\" and \\\"dist-git repo\\\" part is done\\n.:lkocman:. he\'s unable to do anything until that time\\n.:lkocman:. otherwise good work with maitai. Hopefully it could replace pkgwrangler once as well\\n.:wguo:. im opening the diagram to see the detail \\n.:lkocman:. sure\\n.:wguo:. we will do the automated about the package in the EPEL or Fedora task after chinese year \\n.:wguo:. about your concern , then we should add some steps for yours to complete to let developer know it \\n.:wguo:. right ?\\n.:wguo:. i think that will bring extra work to you guys \\n.:lkocman:. exactly\\n.:wguo:. if you like do it  : ) \\n.:lkocman:. well I think that you can query each hour RT\\n.:lkocman:. for state of the ticket\\n.:lkocman:. right?\\n.:wguo:. ok , good idea \\n.:lkocman:. I believe one hour should be sufficient\\n.:wguo:. ok , \\n.:wguo:. the 2nd question , \\\"Also you can\'t build package without having git repo or even branch, this task is missing as well.\\\"\\n.:lkocman:. well I\'ve received one ticket regarding buildsystem\\n.:lkocman:. can you give me list of tasks that goes to us?\\n.:lkocman:. the very first ones\\n.:wguo:. im not very clear about what the system provide you , so i will check it \\n.:wguo:. i mean im not very clear about the system provide you now  \\n.:lkocman:. ok sure\\n.:lkocman:. I can tell you in general what should be my tasks\\n.:wguo:. im sorry for my poor business about this part , anyway i will record your advice \\n.:wguo:. cook \\n.:wguo:. cook\\n.:lkocman:. 1) create dist-git branch\\n.:wguo:. l\\n.:lkocman:. 2) add package into build-system (brew)\\n.:lkocman:. 3) import package to wrangler\\n.:lkocman:. 4) add record to comps\\n.:lkocman:. 5) add record to bugzilla\\n.:lkocman:. these are what I\'m aware of\\n.:lkocman:. while first 2 should be created at once\\n.:wguo:. ok , got it \\n.:lkocman:. so I\'d personally create just a one ticket for it, since I\'m doing these two tasks at once anyway\\n.:lkocman:. buildsystem + branch\\n.:lkocman:. it makes sense since without branch developer can\'t have any date to build\\n.:lkocman:. and without buildsystem record he can\'t build it anyway\\n.:lkocman:. so these two needs to be done in order to be able to build anything\\n.:wguo:. ok , so can we put first 2 on the ticket once ?\\n.:wguo:. just like what you did it ? \\n.:lkocman:. exactly\\n.:wguo:. ok \\n.:lkocman:. add git branch + build system record\\n.:lkocman:. that would save us time and be more effective for developer as well\\n.:wguo:. that\'s also our goal :)\\n.:wguo:. for the 3rd question , Also you can\'t build package without having git repo or even branch, this task is missing as well.\\n.:wguo:. sorry \\n.:wguo:.  I haven\'t seen a task for adding bugzilla component. Which will be required as well.\\n.:wguo:. should be this one \\n.:wguo:. i had found the announcement about maitai 0.13.0  , there is a word  :  \\n.:wguo:. The formerly manual task of \\\"Create Component in Bugzilla\\\" has been replace with an automated Bugzilla job.\\n.:wguo:. Maitai creates the component in Bugzilla and subsequently created distribution bug reports reference the new component.\\n.:lkocman:. nono. That was information for you\\n.:lkocman:.  Also you can\'t build package without having git repo or even branch, this task is missing as well.\\n.:lkocman:. just for you to let you 