s plp7 ,  we added \\nnewly test case to cover this big changes and make the test passed in jenkins .\\n\\n[ July 23 2014 -  August 20, 2014 ]\\nDeveloped and released maitai 0.22 from Jenkins . In this release , we added 3 auditable features to make user can do some review and parseable work on maitai .  \\n\\n\\n\\n\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957494924}}'),('pad:Compass_update:revs:10','{\"changeset\":\"Z:1g7<1|4=6v=w-1$\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957524866}}'),('pad:Compass_update:revs:100','{\"changeset\":\"Z:1b2>5|q=18x=20*0+5$d the\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957691946,\"atext\":{\"text\":\"1. Make all of the release passed in Jenkins with green light\\n2. Defined the suitable scope which mainly focus on the major features and critical bugs , and make sure we can deliver the package in three weeks .\\n\\n[ March 1, 2014 - March 18, 2014 ]\\nReleased maitai 0.17 . In development phase , add relevant unit tests for new features : \\nFeature1: Display list of existing bug reports \\nFeature2: Add bug number to process description\\nand integrated test for modified process:\\nArquillian and selenium test for enhancement  processes RHEL 5/6/7 \\n\\n[ March 22, 2014 - May 8, 2014 ]\\nDeveloped an hotfix version 0.18 for some block bugs for starting RHEL process 7 , and wrote related unit tests for the updated processes .\\n\\n[ May 9, 2014 -  June 6, 2014 ]\\nReleased maitai 0.19 . In this release , added some related unit tests for the changed xml-rpc API of Orgchart and Bugzilla , keep all the tests passed in jenkins and passed qe full test .\\n\\n[  June 7, 2014 - July 2, 2014 ]\\nReleased maitai 0.20 . In this release , most of the changes were related with RHEL process , so we also modified the integrated test and keep all of the changed process passed the test in jenkins and deliver to qe and prod.\\n\\n[ July 3, 2014 -  July 24, 2014]\\nReleased maitai 0.21 .  In this release , there are big adjustments on RHEL process plp7 ,  we added newly test case to cover this big changes and make the test passed in jenkins .\\n\\n[ July 23 2014 -  August 20, 2014 ]\\nReleased maitai 0.22 from Jenkins . In this release , we added 3 auditable features to make user can do some review and parseable work on maitai .  \\n\\n[Sep 5 - Sep 28]\\nParticipate in the  process development in maitai 2.0 project , developed the\\n\\n\\n\\n\\n\",\"attribs\":\"*0|u+1b6|1+1\"}}}'),('pad:Compass_update:revs:101','{\"changeset\":\"Z:1b7>3|q=18x=25*0+3$ pr\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957692449}}'),('pad:Compass_update:revs:102','{\"changeset\":\"Z:1ba<2|q=18x=26-2$\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957692949}}'),('pad:Compass_update:revs:103','{\"changeset\":\"Z:1b8<1|q=18x=25-1$\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957693930}}'),('pad:Compass_update:revs:104','{\"changeset\":\"Z:1b7<3|q=18x=22-3$\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957694430}}'),('pad:Compass_update:revs:105','{\"changeset\":\"Z:1b4>2|q=18x=22*0+2$pr\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957694931}}'),('pad:Compass_update:revs:106','{\"changeset\":\"Z:1b6>4|q=18x=24*0+4$oces\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957695430}}'),('pad:Compass_update:revs:107','{\"changeset\":\"Z:1ba>2|q=18x=28*0+2$s \",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957695931}}'),('pad:Compass_update:revs:108','{\"changeset\":\"Z:1bc>2|q=18x=2a*0+2$\\\"\\\"\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957696430}}'),('pad:Compass_update:revs:109','{\"changeset\":\"Z:1be>1|q=18x=2b*0+1$R\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957697219}}'),('pad:Compass_update:revs:11','{\"changeset\":\"Z:1g6<3|4=6v=t-3$\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957