or the changed xml-rpc API of Orgchart and Bugzilla , keep all the tests passed in jenkins and passed qe full test .\\n\\n[  June 7, 2014 - July 2, 2014 ]\\nReleased maitai 0.20 . In this release , most of the changes were related with RHEL process , so we also modified the integrated test and keep all of the changed process passed the test in jenkins and deliver to qe and prod.\\n\\n[ July 3, 2014 -  July 24, 2014]\\nReleased maitai 0.21 .  In this release , there are big adjustments on RHEL process plp7 ,  we added newly test case to cover this big changes and make the test passed in jenkins .\\n\\n[ July 23 2014 -  August 20, 2014 ]\\nReleased maitai 0.22 from Jenkins . In this release , we added 3 auditable features to make user can do some review and parseable work on maitai .  \\n\\n[Sep 5 - Sep 28]\\nParticipate in the  process development in maitai 2.0 project , developed process \\\"Repo Request\\\" which can be used by all of the engineering in our company to request the project repo in a short time .\\n\\n[Oct 8 - Oct 20]\\nDeve\\n\\n\\n\\n\",\"attribs\":\"*0|w+1f8|1+1\"}}}'),('pad:Compass_update:revs:201','{\"changeset\":\"Z:1f9>1|t=1f1=4*0+1$l\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957782967}}'),('pad:Compass_update:revs:202','{\"changeset\":\"Z:1fa>3|t=1f1=5*0+3$ope\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957783475}}'),('pad:Compass_update:revs:203','{\"changeset\":\"Z:1fd<1|t=1f1=7-1$\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957784112}}'),('pad:Compass_update:revs:204','{\"changeset\":\"Z:1fc<1|t=1f1=6-1$\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957784734}}'),('pad:Compass_update:revs:205','{\"changeset\":\"Z:1fb>2|t=1f1=6*0+2$pe\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957785229}}'),('pad:Compass_update:revs:206','{\"changeset\":\"Z:1fd>4|t=1f1=8*0+4$d th\",\"meta\":{\"author\":\"a.bg1h9PCjbJI3FObZ\",\"timestamp\":1418957785730}}'),('