\":\"Z:99<2-2$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910757011}}'),('pad:drools_guvnor_webdav:revs:39','{\"changeset\":\"Z:97<1|1=n=6-1$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910759383}}'),('pad:drools_guvnor_webdav:revs:4','{\"changeset\":\"Z:i<h-h$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910626016}}'),('pad:drools_guvnor_webdav:revs:40','{\"changeset\":\"Z:96<3|1=n=3-3$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910759884}}'),('pad:drools_guvnor_webdav:revs:41','{\"changeset\":\"Z:93<3|1=n-3$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910760383}}'),('pad:drools_guvnor_webdav:revs:42','{\"changeset\":\"Z:90<7|2=1i-7$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910763482}}'),('pad:drools_guvnor_webdav:revs:43','{\"changeset\":\"Z:8t<7|4=5x-7$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910769172}}'),('pad:drools_guvnor_webdav:revs:44','{\"changeset\":\"Z:8m<7|5=60-7$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910771614}}'),('pad:drools_guvnor_webdav:revs:45','{\"changeset\":\"Z:8f<7|6=6t-7$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910774380}}'),('pad:drools_guvnor_webdav:revs:46','{\"changeset\":\"Z:88<3|6=6t|1-3$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910776219}}'),('pad:drools_guvnor_webdav:revs:47','{\"changeset\":\"Z:85<5|6=6t-5$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910779869}}'),('pad:drools_guvnor_webdav:revs:5','{\"changeset\":\"Z:1>pp*0|q+pp$  350  mkdir /mnt/drools\\n  351  sudo mkdir /mnt/drools\\n  352  wdfs http://maitai.host.dev.eng.pek2.redhat.com:8080/drools-guvnor/org.drools.guvnor.Guvnor/webdav /mnt/drools\\n  353  sudo wdfs http://maitai.host.dev.eng.pek2.redhat.com:8080/drools-guvnor/org.drools.guvnor.Guvnor/webdav /mnt/drools\\n  354  sudo cd /mnt/drools\\n  355  ll\\n  356  cd /mnt/\\n  357  ll\\n  358  cd drools\\n  359  sudo cd drools\\n  360  ll\\n  361  sudo umount /mnt/drools \\n  362  dnf search davfs\\n  363  sudo dnf install davfs2.x86_64\\n  364  mount.davfs http://maitai.host.dev.eng.pek2.redhat.com:8080/drools-guvnor/org.drools.guvnor.Guvnor/webdav /mnt/drools\\n  365  sudo mount.davfs http://maitai.host.dev.eng.pek2.redhat.com:8080/drools-guvnor/org.drools.guvnor.Guvnor/webdav /mnt/drools\\n  366  ll\\n  367  sudo chown wguo:wguo drools/\\n  368  ll\\n  369  cd drools/\\n  370  ll\\n  371  cd packages/\\n  372  ll\\n  373  cd com.redhat.releng/\\n  374  ll\\n  375  history\\n\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910644079}}'),('pad:drools_guvnor_webdav:revs:6','{\"changeset\":\"Z:pq<o-o$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910660523}}'),('pad:drools_guvnor_webdav:revs:7','{\"changeset\":\"Z:p2<1|1-1$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910661023}}'),('pad:drools_guvnor_webdav:revs:8','{\"changeset\":\"Z:p1<ao|1=u|9-9t-v$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910676519}}'),('pad:drools_guvnor_webdav:revs:9','{\"changeset\":\"Z:ed<1=t|1-1$\",\"meta\":{\"author\":\"a.i7ykayVu0y7xvp7G\",\"timestamp\":1536910677098}}'),('pad:EL_poor','{\"atext\":{\"text\":\"we\'re really excited about the portfolio\'s of the poor book and its publication\\n it\'s the best book in a long time to come out about our topics of things we care about,  it helps us get focused on clients\\n\\nthe financial Diaries research which lies at the heart of portfolio for the poor was a terrific exercise\\n it took many many months where interviewers SAT with the families every couple of weeks and you know talk about every single transaction that happened over that week or two \\n\\nand so by the end of several months or a year or 18 months you really have a great picture of all the money coming in and going out of a family\\n\\n and it turns out that people are very complex and sophisticated financial lives, and they spend a lot of time and energy organizing themselves have money when they need it where they need it on average they\'re using something like eight or ten different ways to save money so when they need to do something to have it \\n \\n they borrow, they save, they give money to friends to hold or family to hold it\'s an incredible variety or in richness of ways in which people kind of cope\\n \\n  it\'s really important for us in microfinance and people care about financial inclusion to understand this much more nuanced view of the financial lives of the poor\\n  \\n   because there are ways to be very helpful and have great impact in the poor that are are not just simply giving them a loan so that they can invest in their business\\n   \\n    an awful lot of what people need to do is to organize their money to to me basic daily human needs and they don\'t really have a good place to do it they don\'t have access to banks to keep money so they very money and you know in the mud and the house as they give their money to someone to hold or they have to borrow it pretty high interest rates to do simple things\\n    \\n     for which a savings account might be a lot better answer or some all insurance policy might be a better answer \\n     \\n     so by understanding by looking at the kind of research done that stands behind the portfolio\'s of the poor\\n     \\n      we ought to be able to do a whole lot better design of products we ought to have a new generation of thinking about how you reach many many more people with products that are going to be useful \\n\\nso we\'re very excited about the book very well written and it\'s kind of real tangible stuff that that I think will be a great guide\\n\\n\\n\\n there\'s a woman in the book Sultana who has an income about 32 cents a day\\n she has 20 different loans savings accounts of financial relationships to manage her family of five on just a tiny little bit of income in any given day \\n \\n one of the things we kind of don\'t realize in microfinance is how much money flows through families in any given year so you tend to think well someone is porous as Sudan only has 32 cents a day of income you know must not really have any money around we also think of her in terms of credit we think well she has such a tiny income she\'s going to need just a very tiny loan and that\'s about all we think about when actually one of the things that\'s portfolios of the poor book does and the research behind it is it points out the volume of the flows of money through these informal financial instruments and it turns out that people pull about sixty percent of their annual income through different variety of financial services \\n \\n and that\'s actually pretty big opportunity so even Bangladesh people living on the dollar a day are pulling of nine hundred dollars a year through financial services of one sort or another that feels like a really different opportunity than saying well you know she only has that income we can only make a tiny little loan there\'s all sorts of ways in which those nine hundred dollars that flow through those products can be made a lot more efficient if she\'s saving by buying animals and oftentimes animals get sick or they\'re not really if you have to sell them in a hurry you don\'t get a good price for them if you have to pay for something at the last minute you know you salad for twenty percent of what it\'s worth \\n \\n so the insights from the book help us to think about all the very small tiny little opportunities to be helpful instead of the kind of a great big investment sort of opportunity that you \\nthink about when you say about microcredit\\n\\n nowadays with the advent of mobile banking and using cell phones for banking or using point of service terminals and mom and pop stores to connect people to the bank system we have a historic opportunity to be helpful with the lots of the tiny small little transactions that people need\\n \\n \\n  I think this is a fascinating book for anybody that\'s interested in the financial lives of the world\'s poor it\'s not technical it\'s not full of jargon it\'s very real it\'s very human it\'s got lots of stories about kind of how people get by so if you\'re interested in all and how most of the world lives this is just a great read it\'s not really just for financial service people at all i think most people who would get a kick out of reading it\\n\\n\",\"attribs\":\"*0|15+3ki*0+cd|2+2\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.3y5Xi9jHVYSqllix\"]},\"nextNum\":1},\"head\":45,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:EL_poor:revs:0','{\"changeset\":\"Z:1>6k|5+6k$Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\",\"meta\":{\"author\":\"\",\"timestamp\":1501654828836,\"atext\":{\"text\":\"Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\\n\",\"attribs\":\"|6+6l\"}}}'),('pad:EL_poor:revs:1','{\"changeset\":\"Z:6l>3nr|4-4x-1m*0|4+38t*0+lh$we\'re really excited about the portfolio\'s of the poor book and its publication it\'s the best book in a long time to come out about our topics of things we care about it helps us get focused on clients\\n\\nthe financial Diaries research which lies at the heart of portfolio for the poor was a terrific exercise it took many many months where interviewers SAT with the families every couple of weeks and you know talk about every single transaction that happened over that week or two and so by the end of several months or a year or 18 months you really have a great picture of all the money coming in and going out of a family and it turns out that people are very complex and sophisticated financial lives and they spend a lot of time and energy organizing themselves have money when they need it where they need it on average they\'re using something like eight or ten different ways to save money so when they need to do something to have it they borrow they save they give money to friends to hold or family to hold it\'s an incredible variety or in richness of ways in which people kind of cope it\'s really important for us in microfinance and people care about financial inclusion to understand this much more nuanced view of the financial lives of the poor because there are ways to be very helpful and have great impact in the poor that are are not just simply giving them a loan so that they can invest in their business an awful lot of what people need to do is to organize their money to to me basic daily human needs and they don\'t really have a good place to do it they don\'t have access to banks to keep money so they very money and you know in the mud and the house as they give their money to someone to hold or they have to borrow it pretty high interest rates to do simple things for which a savings account might be a lot better answer or some all insurance policy might be a better answer so by understanding by looking at the kind of research done that stands behind the portfolio\'s of the poor we ought to be able to do a whole lot better design of products we ought to have a new generation of thinking about how you reach many many more people with products that are going to be usef\\nul so we\'re very excited about the book very well written and it\'s kind of real tangible stuff that that I think will be a great guide there\'s a woman in the book Sultana who has an income about 32 cents a day she has 20 different loans savings accounts of financial relationships to manage her family of five on just a tiny little bit of income in any given day one of the things we kind of don\'t realize in microfinance is how much money flows through families in any given year so you tend to think well someone is porous as Sudan only has 32 cents a day of income you know must not really have any money around we also think of her in terms of credit we think well she has such a tiny income she\'s going to need just a very tiny loan and that\'s about all we think about when actually one of the things that\'s portfolios of the poor book does and the research behind it is it points out the volume of the flows of money through these informal financial instruments and it turns out that people pull about sixty percent of their annual income through different variety of financial services and that\'s actually pretty big opportunity so even Bangladesh people living on the dollar a day are pulling of nine hundred dollars a year through financial services of one sort or another that feels like a really different opportunity than saying well you know she only has that income we can only make a tiny little loan there\'s all sorts of ways in which those nine hundred dollars that flow through those products can be made a lot more efficient if she\'s saving by buying animals and oftentimes animals get sick or they\'re not really if you have to sell them in a hurry you don\'t get a good price for them if you have to pay for something at the last minute you know you salad for twenty percent of what it\'s worth so the insights from the book help us to think about all the very small tiny little opportunities to be helpful instead of the kind of a great big investment sort of opportunity that you \\nthink about when you say about microcredit nowadays with the advent of mobile banking and using cell phones for banking or using point of service terminals and mom and pop stores to connect people to the bank system we have a historic opportunity to be helpful with the lots of the tiny small little transactions that people need I think this is a fascinating book for anybody that\'s interested in the financial lives of the world\'s poor it\'s not technical it\'s not full of jargon it\'s very real it\'s very human it\'s got lots of stories about kind of how people get by so if you\'re interested in all and how most of the world lives this is just a great read it\'s not really just for financial service people at all i think most people who would get a kick out of reading it\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501654831625}}'),('pad:EL_poor:revs:10','{\"changeset\":\"Z:3uo>3|a=uq=4l*0|1+1*0+2$\\n  \",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501654970060}}'),('pad:EL_poor:revs:11','{\"changeset\":\"Z:3ur>3|b=zc=2*0|1+1*0+2$\\n  \",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501654970561}}'),('pad:EL_poor:revs:12','{\"changeset\":\"Z:3uu>4|c=zf=4o*0|1+1*0+3$\\n   \",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501654980474}}'),('pad:EL_poor:revs:13','{\"changeset\":\"Z:3uy>4|d=144=3*0|1+1*0+3$\\n   \",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501654980974}}'),('pad:EL_poor:revs:14','{\"changeset\":\"Z:3v2>5|e=148=ab*0|1+1*0+4$\\n    \",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501654999854}}'),('pad:EL_poor:revs:15','{\"changeset\":\"Z:3v7>5|f=1ek=4*0|1+1*0+4$\\n    \",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501655000353}}'),('pad:EL_poor:revs:16','{\"changeset\":\"Z:3vc>1|h=1q8=3*0|1+1$\\n\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501655026506}}'),('pad:EL_poor:revs:17','{\"changeset\":\"Z:3vd>1|i=1qc*0|1+1$\\n\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501655027006}}'),('pad:EL_poor:revs:18','{\"changeset\":\"Z:3ve>1|j=1qd=3n*0|1+1$\\n\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501655032434}}'),('pad:EL_poor:revs:19','{\"changeset\":\"Z:3vf>3|k=1u1*0|3+3$\\n\\n\\n\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"