or:revs:44','{\"changeset\":\"Z:3wv>1|1=28=2f*0+1$,\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504241940250}}'),('pad:EL_poor:revs:45','{\"changeset\":\"Z:3ww>1|1=28=2g*0+1$ \",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504241940801}}'),('pad:EL_poor:revs:5','{\"changeset\":\"Z:3uf>1|5=hf*0|1+1$\\n\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501654932363}}'),('pad:EL_poor:revs:6','{\"changeset\":\"Z:3ug>2|6=hg=8u*0|1+1*0+1$\\n \",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501654950849}}'),('pad:EL_poor:revs:7','{\"changeset\":\"Z:3ui>2|7=qb=1*0|1+1*0+1$\\n \",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501654951347}}'),('pad:EL_poor:revs:8','{\"changeset\":\"Z:3uk>2|8=qd=4a*0|1+1*0+1$\\n \",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501654960982}}'),('pad:EL_poor:revs:9','{\"changeset\":\"Z:3um>2|9=uo=1*0|1+1*0+1$\\n \",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1501654961482}}'),('pad:EL_POOR_BLANKS','{\"atext\":{\"text\":\"we\'re really excited about the portfolio\'s of the poor book and its publication\\n it\'s the best book in a long time to come out about our topics of things we care about,  it helps us get focused on clients\\n\\nthe financial Diaries research which lies at the heart of portfolio for the poor was a terrific exercise\\n it took many many months where interviewers SAT with the families every couple of weeks and you know talk about every single transaction that happened over that week or two \\n\\nand so by the end of several months or a year or 18 months you really have a great picture of all the money coming in and going out of a family\\n\\n and it turns out that people are very ____________ financial lives, and they ___________________________________ when they need it where they need it ______________ they\'re using something like eight or ten different ways to save money so when they need to do something to have it \\n \\n they borrow, they save, they give money to friends to hold or family to hold it\'s an incredible variety or in richness of ways in which people kind of cope\\n \\n  it\'s really important for us in microfinance and people care about financial inclusion to understand this much more nuanced view of the financial lives of the poor\\n  \\n   because there are ways to be very helpful and have great impact in the poor that are are not just simply giving them a loan so that they can invest in their business\\n   \\n    an awful lot of what people need to do is to organize their money to to me basic daily human needs and they don\'t really have a good place to do it they don\'t have access to banks to keep money so they very money and you know in the mud and the house as they give their money to someone to hold or they have to borrow it pretty high interest rates to do simple things\\n    \\n     for which a savings account might be a lot better answer or some all insurance policy might be a better answer \\n     \\n     so by understanding by looking at the kind of research done that stands behind the portfolio\'s of the poor\\n     \\n      we ought to be able to do a whole lot better design of products we ought to have a new generation of thinking about how you reach many many more people with products that are going to be useful \\n\\nso we\'re very excited about the book very well written and it\'s kind of real tangible stuff that that I think will be a great guide\\n\\n\\n\\n there\'s a woman in the book Sultana who has an income about 32 cents a day\\n she has 20 different loans savings accounts of financial relationships to manage her family of five on just a tiny little bit of income in any given day \\n \\n one of the things we kind of don\'t realize in microfinance is how much money flows through families in any given year so you tend to think well someone is porous as Sudan only has 32 cents a day of income you know must not really have any money around we also think of her in terms of credit we think well she has such a tiny income she\'s going to need just a very tiny loan and that\'s about all we think about when actually one of the things that\'s portfolios of the poor book does and the research behind it is it points out the volume of the flows of money through these informal financial instruments and it turns out that people pull about sixty percent of their annual income through different variety of financial services \\n \\n and that\'s actually pretty big opportunity so even Bangladesh people living on the dollar a day are pulling of nine hundred dollars a year through financial services of one sort or another that feels like a really different opportunity than saying well you know she only has that income we can only make a tiny little loan there\'s all sorts of ways in which those nine hundred dollars that flow through those products can be made a lot more efficient if she\'s saving by buying animals and oftentimes animals get sick or they\'re not really if you have to sell them in a hurry you don\'t get a good price for them if you have to pay for something at the last minute you know you salad for twenty percent of what it\'s worth \\n \\n so the insights from the book help us to think about all the very small tiny little opportunities to be helpful instead of the kind of a great big investment sort of opportunity that you \\nthink about when you say about microcredit\\n\\n nowadays with the advent of mobile banking and using cell phones for banking or using point of service terminals and mom and pop stores to connect people to the bank system we have a historic opportunity to be helpful with the lots of the tiny small little transactions that people need\\n \\n \\n  I think this is a fascinating book for anybody that\'s interested in the financial lives of the world\'s poor it\'s not technical it\'s not full of jargon it\'s very real it\'s very human it\'s got lots of stories about kind of how people get by so if you\'re interested in all and how most of the world lives this is just a great read it\'s not really just for financial service people at all i think most people who would get a kick out of reading it\\n\\n\",\"attribs\":\"*0|15+3jh*0+cd|2+2\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.3y5Xi9jHVYSqllix\"]},\"nextNum\":1},\"head\":15,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:EL_POOR_BLANKS:revs:0','{\"changeset\":\"Z:1>6k|5+6k$Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\",\"meta\":{\"author\":\"\",\"timestamp\":1504533223186,\"atext\":{\"text\":\"Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\\n\",\"attribs\":\"|6+6l\"}}}'),('pad:EL_POOR_BLANKS:revs:1','{\"changeset\":\"Z:6l>3qc|4-4x-1m*0|15+3ki*0+cd$we\'re really excited about the portfolio\'s of the poor book and its publication\\n it\'s the best book in a long time to come out about our topics of things we care about,  it helps us get focused on clients\\n\\nthe financial Diaries research which lies at the heart of portfolio for the poor was a terrific exercise\\n it took many many months where interviewers SAT with the families every couple of weeks and you know talk about every single transaction that happened over that week or two \\n\\nand so by the end of several months or a year or 18 months you really have a great picture of all the money coming in and going out of a family\\n\\n and it turns out that people are very complex and sophisticated financial lives, and they spend a lot of time and energy organizing themselves have money when they need it where they need it on average they\'re using something like eight or ten different ways to save money so when they need to do something to have it \\n \\n they borrow, they save, they give money to friends to hold or family to hold it\'s an incredible variety or in richness of ways in which people kind of cope\\n \\n  it\'s really important for us in microfinance and people care about financial inclusion to understand this much more nuanced view of the financial lives of the poor\\n  \\n   because there are ways to be very helpful and have great impact in the poor that are are not just simply giving them a loan so that they can invest in their business\\n   \\n    an awful lot of what people need to do is to organize their money to to me basic daily human needs and they don\'t really have a good place to do it they don\'t have access to banks to keep money so they very money and you know in the mud and the house as they give their money to someone to hold or they have to borrow it pretty high interest rates to do simple things\\n    \\n     for which a savings account might be a lot better answer or some all insurance policy might be a better answer \\n     \\n     so by understanding by looking at the kind of research done that stands behind the portfolio\'s of the poor\\n     \\n      we ought to be able to do a whole lot better design of products we ought to have a new generation of thinking about how you reach many many more people with products that are going to be useful \\n\\nso we\'re very excited about the book very well written and it\'s kind of real tangible stuff that that I think will be a great guide\\n\\n\\n\\n there\'s a woman in the book Sultana who has an income about 32 cents a day\\n she has 20 different loans savings accounts of financial relationships to manage her family of five on just a tiny little bit of income in any given day \\n \\n one of the things we kind of don\'t realize in microfinance is how much money flows through families in any given year so you tend to think well someone is porous as Sudan only has 32 cents a day of income you know must not really have any money around we also think of her in terms of credit we think well she has such a tiny income she\'s going to need just a very tiny loan and that\'s about all we think about when actually one of the things that\'s portfolios of the poor book does and the research behind it is it points out the volume of the flows of money through these informal financial instruments and it turns out that people pull about sixty percent of their annual income through different variety of financial services \\n \\n and that\'s actually pretty big opportunity so even Bangladesh people living on the dollar a day are pulling of nine hundred dollars a year through financial services of one sort or another that feels like a really different opportunity than saying well you know she only has that income we can only make a tiny little loan there\'s all sorts of ways in which those nine hundred dollars that flow through those products can be made a lot more efficient if she\'s saving by buying animals and oftentimes animals get sick or they\'re not really if you have to sell them in a hurry you don\'t get a good price for them if you have to pay for something at the last minute you know you salad for twenty percent of what it\'s worth \\n \\n so the insights from the book help us to think about all the very small tiny little opportunities to be helpful instead of the kind of a great big investment sort of opportunity that you \\nthink about when you say about microcredit\\n\\n nowadays with the advent of mobile banking and using cell phones for banking or using point of service terminals and mom and pop stores to connect people to the bank system we have a historic opportunity to be helpful with the lots of the tiny small little transactions that people need\\n \\n \\n  I think this is a fascinating book for anybody that\'s interested in the financial lives of the world\'s poor it\'s not technical it\'s not full of jargon it\'s very real it\'s very human it\'s got lots of stories about kind of how people get by so if you\'re interested in all and how most of the world lives this is just a great read it\'s not really just for financial service people at all i think most people who would get a kick out of reading it\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504533230393}}'),('pad:EL_POOR_BLANKS:revs:10','{\"changeset\":\"Z:3w8>7|8=hk=13*0+7$_______\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504533287128}}'),('pad:EL_POOR_BLANKS:revs:11','{\"changeset\":\"Z:3wf>1|8=hk=1a*0+1$_\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504533287622}}'),('pad:EL_POOR_BLANKS:revs:12','{\"changeset\":\"Z:3wg>1|8=hk=1b*0+1$_\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504533289260}}'),('pad:EL_POOR_BLANKS:revs:13','{\"changeset\":\"Z:3wh>3|8=hk=1c*0+3$___\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504533289756}}'),('pad:EL_POOR_BLANKS:revs:14','{\"changeset\":\"Z:3wk>4|8=hk=4z-a*0+e$______________\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504533303314}}'),('pad:EL_POOR_BLANKS:revs:15','{\"changeset\":\"Z:3wo<s|8=hk=26-1r*0+z$___________________________________\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504533330468}}'),('pad:EL_POOR_BLANKS:revs:2','{\"changeset\":\"Z:3wx<q|8=hk=12-q$\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504533281190}}'),('pad:EL_POOR_BLANKS:revs:3','{\"changeset\":\"Z:3w7>1|8=hk=12*0+1$ \",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504533281648}}'),('pad:EL_POOR_BLANKS:revs:4','{\"changeset\":\"Z:3w8>f|8=hk=13*0+f$---------------\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504533283260}}'),('pad:EL_POOR_BLANKS:revs:5','{\"changeset\":\"Z:3wn<3|8=hk=1f-3$\",\"meta\":{\"author\":\"a.3y5Xi9jHVYSqllix\",\"timestamp\":1504533283761}}'),('pad:EL_POOR_BLANKS:revs