ng about \'Missing Product Listings\' should not be shown for non-rpm PDC advisory\\n- Bug 1499235 [RFE] Push request RCM for every \'async\' advisory\\n- Bug 1498312 Can\'t edit ET release groups when associated PDC releases are missing\\n- Bug 1497319 [RFE] Require an \\\"RHSA SLA\\\" expiry date in the Errata Tool UI\\n- Bug 1496771 Can\'t add RHBA-2017:30568 here because it would create a circular dependency.\\n- Bug 1496633 Dev container broken, cannot install mock\\n- Bug 1495079 [Testing] [PDC] Test the rpmdiff for PDC advisory when package have two old released packages\\n- Bug 1495078 /api/v1/erratum{id}/builds API does not list builds that lack product listings\\n- Bug 1492600 [PDC]Error \'undefined method `has_docker?\'\' when viewing advisory after docker build is added\\n- Bug 1492584 When reloading files of advisory, meet the error \\\"NoMethodError: undefined method `pv_or_pr\'\\n- Bug 1492563 [PDC][regression] Error \'undefined method `product_version\'\' is returned when trying to remove a build from pdc advisory\\n- Bug 1491822 [RFE]Compose list of CDN-only content\\n- Bug 1489236 Development packages job will fail with permission problems trying to clean up old jobs\\n- Bug 1488698 PDC advisories have to selectively obsolete released packages\\n- Bug 1483398 Affected by CAT feature, the \\\"workflow_rules\\\" should be updated\\n- Bug 1488311 [RFE] Show release date on Container tab for Health Index at release\\n- Bug 1487012 [RFE] \\\"Assigned to you\\\" and \\\"reported by you\\\" system filters should include IN_PUSH advisories\\n- Bug 1486563 Find solution for masking RHEL-7 buildroot product variants in errata artifacts\\n- Bug 1483767 API add_builds should not allow multiple nvrs of the same package\\n- Bug 1482759 Kerberos auth doesn\'t work on ET instance with db loaded from fixture data due to mysql case sensitivity\\n- Bug 1481538 [Usability] the flash message for Rhn stage/rhn live CAT job reschedule is not exact\\n- Bug 1481479 text on