 to be added in QE state\\n- Bug 1200412 ET does not warn about accidentally adding a build for a wrong component\\n- Bug 1169537 [Performance] Deploy more Delayed::Job workers\\n- Bug 992970 No validation check for bug status when creating a product\\n- Bug 861146 [RFE] Synopsis character limit\\n\\n\\n\",\"attribs\":\"*0|2u+5pc|2+2\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.bkIC8TnCoRpfXtzX\"]},\"nextNum\":1},\"head\":8,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:Errata_3.16.1_release:revs:0','{\"changeset\":\"Z:1>6k|5+6k$Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\",\"meta\":{\"author\":\"\",\"timestamp\":1516857450635,\"atext\":{\"text\":\"Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\\n\",\"attribs\":\"|6+6l\"}}}'),('pad:Errata_3.16.1_release:revs:1','{\"changeset\":\"Z:6l<6i|4-4x-1m*0+1$1\",\"meta\":{\"author\":\"a.bkIC8TnCoRpfXtzX\",\"timestamp\":1516857454456}}'),('pad:Errata_3.16.1_release:revs:2','{\"changeset\":\"Z:3>1=1*0+1$.\",\"meta\":{\"author\":\"a.bkIC8TnCoRpfXtzX\",\"timestamp\":1516857455273}}'),('pad:Errata_3.16.1_release:revs:3','{\"changeset\":\"Z:4>1=2*0+1$ \",\"meta\":{\"author\":\"a.bkIC8TnCoRpfXtzX\",\"timestamp\":1516857455787}}'),('pad:Errata_3.16.1_release:revs:4','{\"changeset\":\"Z:5>4=3*0+4$jira\",\"meta\":{\"author\":\"a.bkIC8TnCoRpfXtzX\",\"timestamp\":1516857456287}}'),('pad:Errata_3.16.1_release:revs:5','{\"changeset\":\"Z:9>1=7*0+1$ \",\"meta\":{\"author\":\"a.bkIC8TnCoRpfXtzX\",\"timestamp\":1516857456823}}'),('pad:Errata_3.16.1_release:revs:6','{\"changeset\":\"Z:a>1=8*0|1+1$