sthaha>  So now you have the right ruby and the gems \\n<wguo> corrent\\n<wguo> correct\\n<sthaha> 4. I asked you to start rails but it failed due to missing db, so we started the db, and populated it using rake db: .... \\n<sthaha> 5. the rails started properly using bundle exec rails server \\n<wguo> right \\n<sthaha> 6. found the right port that is forwarded \\n<wguo> yes, \\n<wguo> what i exec in the container: \\n<wguo> bundle install -j8 --no-cache --path ~/et/gem/rh6-ruby22\\n<wguo> cat .bundle/config\\n<wguo> sudo service mysqld start\\n<wguo> mysql -u root   (create db errata)\\n<wguo> bundle exec rake db:create db:schema:load db:fixtures:load\\n<wguo> bundle exec rails server\\n<wguo> thanks Sunil for the support : )\\n<sthaha> mysql -u root   (create db errata) isn\'t needed\\n<sthaha> db:create should do that\\n<wguo> all right : )\\n<sthaha> db:create will create the db, schema:load creates tables and indices, fixture:load loads the data\\n<sthaha> bundle exec rake -P \\n<wguo> k, make sense \\n<sthaha> wguo I don\'t use this setup ... (all in one container)\\n<sthaha> I run a different db container \\n\",\"attribs\":\"*0|s+12a*0+14|1+1\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.xEgMlPhQ6AwpK2mJ\"]},\"nextNum\":1},\"head\":2,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:ERRATA_DOCKER_RUBY22:revs:0','{\"changeset\":\"Z:1>1x+1x$This a private pad platform which you can record what you want to! :)\",\"meta\":{\"author\":\"\",\"timestamp\":1477458305122,\"atext\":{\"text\":\"This a private pad platform which you can record what you want to! :)\\n\",\"attribs\":\"|1+1y\"}}}'),('pad:ERRATA_DOCKER_RUBY22:revs:1','{\"changeset\":\"Z:1y<1x-1x$\",\"meta\":{\"author\":\"a.xEgMlPhQ6AwpK2mJ\",\"timestamp\":1477458308591}}'),('pad:ERRATA_DOCKER_RUBY22:revs:2','{\"changeset\":\"Z:1>13e*0|s+12a*0+14$<sthaha> 1. I ensured you are running the right container, ruby-version\\n<wguo> yeah \\n<sthaha> 2. I wanted to ensu