       File doneF = new File(pkgwEnv + nvr + \\\".brew.done\\\");\\n            try {\\n                doneF.createNewFile();\\n            } catch (IOException e) {\\n                e.printStackTrace();\\n            }\\n        }\\n        LOGGER.info(\\\"Step 2, import srpm into pkgw nvr #{}\\\", nvr);\\n        //TODO\\n        command = \\\"pkgwcli import-srpm --add-whitelist --product=\\\"+ release + nvr + \\\".src.rpm\\\";\\n        output = obj.executeCommand(command, null, pkgwEnv);\\n        //TODO log the import status\\n        FileOutputStream fop = null;\\n        File logF = new File(pkgwEnv + nvr + \\\".log\\\");\\n        try    {\\n            logF.createNewFile();\\n            fop = new FileOutputStream(logF);\\n            byte[] contentInBytes = output.getBytes();\\n\\n            fop.write(contentInBytes);\\n            fop.flush();\\n            fop.close();\\n        } catch (IOException e){\\n            //\\n        } finally {\\n            IOUtils.closeQuietly(fop);\\n        }\\n        System.out.println(output);\\n        LOGGER.info(\\\"Step 3, filter relevant info from output\\\");\\n        //TODO\\n        String pattern = \\\"https://(.*)(\\\\\\\\d+)(.*)\\\";\\n        Pattern p = Pattern.compile(pattern);\\n        Matcher m = p.matcher(output);\\n        String taskUrl = null;\\n        if (m.find()){\\n            System.out.println(m.group());\\n            taskUrl = m.group();\\n        }\\n        String pattern2 = \\\"(\\\\\\\\d+)(.*)\\\";\\n        Pattern p2 = Pattern.compile(pattern2);\\n        Matcher m2 = p2.matcher(output);\\n        if (m2.find()){\\n            System.out.println(m2.group());\\n        }\\n        //TODO Please rm rpm once everything done\\n        if(StringUtils.isNotBlank(taskUrl)){\\n            f.delete();\\n        }\\n        \\n    }\\n\\n\\n\\n}\\n\",\"meta\":{\"author\":\"a.nGP8SbKh35ZHg2Am\",\"timestamp\":1441523406558}}'),('pad:IMPORT_SRPM_CODE_SNAPSHOT:revs:10','{\"changeset\":\"Z:3un<358|2=19=7|3n-3t3*0|w+nq*0+5$org.slf4j.Logger;\\nimport org.slf4j.LoggerFactory;\\n\\npublic class ProcessWithTimeout extends Thread {\\n\\n    private static final Logger LOGGER = LoggerFactory.getLogger(ProcessWithTimeout.class);\\n    private Process process;\\n    private int exitCode = Integer.MIN_VALUE;\\n\\n    public ProcessWithTimeout(Process process) {\\n        this.process = process;\\n    }\\n\\n    public int waitForProcess(int timeoutMilliseconds) {\\n        this.start();\\n        try {\\n            this.join(timeoutMilliseconds);\\n        } catch (InterruptedException e) {\\n            this.interrupt();\\n        }\\n        return exitCode;\\n    }\\n\\n    @Override\\n    public void run() {\\n        try {\\n            exitCode = process.waitFor();\\n        } catch (InterruptedException ignore) {\\n            // Do nothing\\n        } catch (Exception ex) {\\n            LOGGER.error(\\\"\\\", ex);\\n        }\\n    }\",\"meta\":{\"author\":\"a.nGP8SbKh35ZHg2Am\",\"timestamp\":1441768191065}}'),('pad:IMPORT_SRPM_CODE_SNAPSHOT:revs:11','{\"changeset\":\"Z:pf<d3|2=19=b|w-nm-5*0|c+ao$testng.annotations.Test;\\n\\npublic class ShellExecutorTest {\\n\\n    @Test(enabled=true)\\n    public void test() throws Exception{\\n        Thread t = new Thread(new ImportSrpm(\\\"RHEL-7.1\\\", \\\"opa-fm-10.0.0.0-438.el7\\\"));\\n        ThreadWorkStation.getBrewExecutor().execute(t);\\n        ThreadWorkStation.healthCheck();\\n        Thread.sleep(60000);\\n        ThreadWorkStation.healthCheck();\\n    }\\n\",\"meta\":{\"author\":\"a.nGP8SbKh35ZHg2Am\",\"timestamp\":1441768257988}}'),('pad:IMPORT_SRPM_CODE_SNAPSHOT:revs:2','{\"changeset\":\"Z:2h7>6|1j=1ei=26*0+6$\\\" \\\" + \",\"meta\":{\"author\":\"a.nGP8SbKh35ZHg2Am\",\"timestamp\":1441523616652}}'),('pad:IMPORT_SRPM_CODE_SNAPSHOT:revs:3','{\"changeset\":\"Z:2hd>1|2r=2ha=1*1|1+1$\\n\",\"meta\":{\"author\":\"a.647bevAIHuqLLREt\",\"timestamp\":1441527013824}}'),('pad:IMPORT_SRPM_CODE_SNAPSHOT:revs:4',