envp, String dirPath) {\\n        LOGGER.info(\\\"CMD:>> {}\\\", command);\\n        StringBuffer output = new StringBuffer();\\n        StringBuffer errors = new StringBuffer();\\n        Process p;\\n        try {\\n            File dir = new File(dirPath);\\n            p = Runtime.getRuntime().exec(command, null, dir);\\n            ProcessWithTimeout pwt = new ProcessWithTimeout(p);\\n            int exitCode = pwt.waitForProcess(timeoutMilliseconds);\\n\\n            if (exitCode == Integer.MIN_VALUE) {\\n                throw new Exception(\\\"Exec command \\\" + command + \\\" timeout in \\\" + timeoutMilliseconds + \\\" milliseconds\\\");\\n            }\\n            BufferedReader reader = new BufferedReader(new InputStreamReader(\\n                    p.getInputStream()));\\n\\n            BufferedReader errorReader = new BufferedReader(new InputStreamReader(\\n                    p.getErrorStream()));\\n\\n            String line = \\\"\\\";\\n            while ((line = reader.readLine()) != null) {\\n                output.append(line).append(LINE_FEED);\\n            }\\n            while ((line = errorReader.readLine()) != null) {\\n                errors.append(line).append(LINE_FEED);\\n            }\\n        } catch (Exception e) {\\n            LOGGER.error(\\\"Execute cmd error.\\\", e);\\n            return e.getMessage();\\n        }\\n        LOGGER.info(\\\"Result:\\\\n {}\\\",\\n                StringUtils.isNotBlank(errors.toString()) ? errors.toString()\\n                        : output.toString());\\n        return StringUtils.isNotBlank(errors.toString()) ? errors.toString() : output.toString();\\n\\n    }\\n\\n}\\n\",\"meta\":{\"author\":\"a.nGP8SbKh35ZHg2Am\",\"timestamp\":1441768126368}}'),('pad:IMPORT_SRPM_CODE_SNAPSHOT:revs:9','{\"changeset\":\"Z:1ll>292|2=19=f|1d-1jm*0|3l+3sf*0+9$File;\\nimport java.io.FileOutputStream;\\nimport java.io.IOException;\\nimport java.util.regex.Matcher;\\nimport java.util.regex.Pattern;\\n\\nimport org.apache.commons.configuration.CompositeConfiguration;\\nimport org.apache.commons.configuration.ConfigurationException;\\nimport org.apache.commons.configuration.PropertiesConfiguration;\\nimport org.apache.commons.configuration.SystemConfiguration;\\nimport org.apache.commons.io.IOUtils;\\nimport org.apache.commons.lang.StringUtils;\\nimport org.slf4j.Logger;\\nimport org.slf4j.LoggerFactory;\\n\\n/**\\n * Maitai invoke the cli via Runtime to import srpm to pkgwrangler,\\n * and before this we need get the rpm from Brew first by NVR.\\n * e.g:\\n * brew download-build --arch=src ${nvr}\\n * pkgwcli import-srpm --add-whitelist --product=\\\"${release}\\\" ${nvr}.src.rpm\\n *\\n */\\npublic class ImportSrpm implements Runnable {\\n\\n    private static final Logger LOGGER = LoggerFactory.getLogger(ImportSrpm.class);\\n\\n    private static final String CLASSPATH_CONFIG = \\\"maitai.conf\\\";\\n    private static final String DEFAULT_CONFIG = \\\"/etc/maitai.conf\\\";\\n    private static final String DEFAULT_PKGWS = \\\"/var/cache/maitai/pkgws/\\\";\\n    private static final String DEFAULT_KEYTAB_PATH = \\\"/etc/jbossas/standalone/jboss.keytab\\\";\\n\\n    private String nvr;\\n    private String release;\\n    private String pkgwEnv;\\n    private String keytab;\\n\\n    public ImportSrpm(String release, String nvr){\\n        this.release = release;\\n        this.nvr = nvr;\\n        CompositeConfiguration config = new CompositeConfiguration();\\n        config.addConfiguration(new SystemConfiguration());\\n        try {\\n            config.addConfiguration(new PropertiesConfiguration(CLASSPATH_CONFIG));\\n        } catch (ConfigurationException e) {\\n            LOGGER.warn(\\\"Failed to load Maitai config file {}: {}\\\", CLASSPATH_CONFIG, e.getMessage());\\n        }\\n        try {\\n            config.addConfiguration(new PropertiesConfiguration(DEFAULT_CONFIG));\\n        } catch (ConfigurationException e) {\\n            LOGGER.warn(\\\"Failed to load Maitai config file {}: {}\\\", DEFAULT_CONFIG, e.getMessage());\\n        }\\n        this.pkgwEnv = config.getString(\\\"pkgw.ws\\\", DEFAULT_PKGWS);\\n        this.keytab = config.getString(\\\"brew.krb.keytab\\\", DEFAULT_KEYTAB_PATH);\\n    }\\n\\n    @Override\\n    public void run() {\\n        ShellExecutor obj = new ShellExecutor();\\n        LOGGER.info(\\\"ImportSrpm starting, release {} and nvr #{}\\\", release, nvr);\\n\\n        String command = \\\"hostname\\\";\\n        String hostname = obj.executeCommand(command, null, pkgwEnv);\\n        LOGGER.info(\\\"hostname {}\\\", hostname);\\n        command = \\\"kinit -k -t \\\" + keytab + \\\" maitai/\\\" + StringUtils.trim(hostname) + \\\"@REDHAT.COM\\\";\\n        obj.executeCommand(command, null, pkgwEnv);\\n\\n        LOGGER.info(\\\"Step 1, brew download-build nvr #{}\\\", nvr);\\n        command = \\\"brew download-build --arch=src \\\" + nvr;\\n        LOGGER.info(\\\">> {}\\\", command);\\n        String output = obj.executeCommand(command, null, pkgwEnv);\\n        File rpmFile = downloadRpmFromBrew();\\n\\n        LOGGER.info(\\\"Step 2, import srpm into pkgw nvr #{}\\\", nvr);\\n        command = \\\"pkgwcli import-srpm --add-whitelist --product=\\\"+ release + \\\" \\\" + nvr + \\\".src.rpm\\\";\\n        LOGGER.info(\\\">> {}\\\", command);\\n        output = obj.executeCommand(command, null, pkgwEnv);\\n\\n        auditImportStatus(output);\\n\\n        LOGGER.info(\\\"Step 3, filter relevant info from output\\\");\\n        String taskUrl = queryTaskUrl(output);\\n        LOGGER.info(\\\"taskUrl #{}\\\", taskUrl);\\n\\n        if(StringUtils.isNotBlank(taskUrl)){\\n            LOGGER.info(\\\"Step 4, remove the rpm {} due to everything done.\\\", nvr);\\n            rpmFile.delete();\\n        }\\n    }\\n\\n    private String queryTaskUrl(String output) {\\n        String pattern = \\\"https://(.*)(\\\\\\\\d+)(.*)\\\";\\n        Pattern p = Pattern.compile(pattern);\\n        Matcher m = p.matcher(output);\\n        if (m.find()){\\n            return m.group();\\n        }\\n        return null;\\n    }\\n\\n    private File downloadRpmFromBrew() {\\n        File rpmFile = new File(pkgwEnv + nvr + \\\".src.rpm\\\");\\n        if (rpmFile.exists() ){\\n            System.out.println(\\\"Brew download done!\\\");\\n            File doneF = new File(pkgwEnv + nvr + \\\".brew.done\\\");\\n            try {\\n                doneF.createNewFile();\\n            } catch (IOException e) {\\n                LOGGER.error(\\\"Create brew file exception\\\", e);\\n            }\\n        }\\n        return rpmFile;\\n    }\\n\\n    private void auditImportStatus(String output) {\\n        FileOutputStream fop = null;\\n        File logF = new File(pkgwEnv + nvr + \\\".log\\\");\\n        try    {\\n            logF.createNewFile();\\n            fop = new FileOutputStream(logF);\\n            byte[] contentInBytes = output.getBytes();\\n\\n            fop.write(contentInBytes);\\n            fop.flush();\\n            fop.close();\\n        } catch (IOException e){\\n            LOGGER.error(\\\"Create log file exception\\\", e);\\n        } finally {\\n            IOUtils.closeQuietly(fop);\\n        }\",\"meta\":{\"author\":\"a.nGP8SbKh35ZHg2Am\",\"timestamp\":1441768167588}}'),('pad:Indy_content_type','{\"atext\":{\"text\":\"gally: HttpDownload.java\\n          AbstractHttpJob.java\\n         HTTPExchangeMetadata.java\\n         \\nIndy: HttpConduitWrapper.java\\n         ProxyResponseWriter.java\\n         \\n         ResponseUtils.java\\n            \\nsetInfoHeaders\\n         \\n         \\n         \\nwriteExistingTransfer\\nopenjdk: \\nMimetypesFileTypeMap\\n\",\"attribs\":\"*0|5+3n*0+x*1|4+1g*1+e*0|6+1r*0+k|1+1\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.i7ykayVu0y7xvp7G\"],\"1\":[\"author\",\"a.8oStYsgT7Sj8E9TS\"]},\"nextNum\":2},\"head\":126,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:Indy_