   return new String[]{oe.getId(),oe.getId()};\\n                //}\\n            }\\n        };\\n    }\\n    \\n    \\n    \\n    We need to get the mapping of orgchart group to ldap group, and update the orgchart id into ldap name\\n    \\n    \\n    \\n    mysql> select * from OrganizationalEntity where DTYPE=\'Group\';\\n+-------+------+\\n| DTYPE | id   |\\n+-------+------+\\n| Group | 5    |\\n| Group | 4    |\\n| Group | 528  |\\n| Group | 1    |\\n| Group | 1070 |\\n| Group | 5530 |\\n+-------+------+\\n\\n\\n\\nNOTE: orgchart groups are migrate\\n\",\"attribs\":\"+1*0|16+xp*0+x|1+1\"}}}'),('pad:OrgChartTOLDAP:revs:201','{\"changeset\":\"Z:yo>4|16=xq=x*0+4$d in\",\"meta\":{\"author\":\"a.W4wttTE7weZEudE4\",\"timestamp\":1532938437335}}'),('pad:OrgChartTOLDAP:revs:202','{\"changeset\":\"Z:ys>4|16=xq=11*0+4$to l\",\"meta\":{\"author\":\"a.W4wttTE7weZEudE4\",\"timestamp\":1532938437835}}'),('pad:OrgChartTOLDAP:revs:203','{\"changeset\":\"Z:yw>2|16=xq=15*0+2$da\",\"meta\":{\"author\":\"a.W4wttTE7weZEudE4\",\"timestamp\":1532938438531}}'),('pad:OrgChartTOLDAP:revs:204','{\"changeset\":\"Z:yy>1|16=xq=17*0+1$p\",\"meta\":{\"author\":\"a.W4wttTE7weZEudE4\",\"timestamp\":1532938439150}}'),('pad:OrgChartTOLDAP:revs:205','{\"changeset\":\"Z:yz>3|16=xq=18*0+3$ wi\",\"meta\":{\"author\":\"a.W4wttTE7weZEudE4\",\"timestamp\":1532938439648}}'),('pad:OrgChartTOLDAP:revs:206','{\"changeset\":\"Z:z2>2|16=xq=1b*0+2$th\",\"meta\":{\"author\":\"a.W4wttTE7weZEudE4\",\"timestamp\":1532938440150}}'),('pad:OrgChartTOLDAP:revs:207','{\"changeset\":\"Z:z4>1|16=xq=1d*0+1$ \",\"meta\":{\"author\":\"a.W4wttTE7weZEudE4\",\"timestamp\":1532938440649}}'),('pad:OrgChartTOLDAP:revs:208','{\"changeset\":\"Z:z5>5|16=xq=1e*0+5$a new\",\"meta\":{\"author\":\"a.W4wttTE7weZEudE4\",\"timestamp\":1532938441149}}'),('pad:OrgChartTOLDAP:revs:209','{\"changeset\":\"Z:za>2|16=xq=1j*0+2$ l\",\"meta\":{\"author\":\"a.W4wttTE7weZEudE4\",\"timestamp\":1532938441649}}'),('pad:OrgChartTOLDAP:revs:21','{\"chan