1532683289191}}'),('pad:OrgChartTOLDAP:revs:97','{\"changeset\":\"Z:5o>4|3=34=2j*0+4$the \",\"meta\":{\"author\":\"a.W4wttTE7weZEudE4\",\"timestamp\":1532683289692}}'),('pad:OrgChartTOLDAP:revs:98','{\"changeset\":\"Z:5s>4|3=34=2n*0+4$grou\",\"meta\":{\"author\":\"a.W4wttTE7weZEudE4\",\"timestamp\":1532683290194}}'),('pad:OrgChartTOLDAP:revs:99','{\"changeset\":\"Z:5w>2|3=34=2r*0+2$p \",\"meta\":{\"author\":\"a.W4wttTE7weZEudE4\",\"timestamp\":1532683290693}}'),('pad:Package_Management_Note','{\"atext\":{\"text\":\"<pbabinca> ping; wrt MAITAI-3981\\n<wguo> hey : )\\n<pbabinca> Hi, I\'d like to clarify couple of things and I guess IRC would be faster\\n<wguo> sure \\n<pbabinca> I was told people doesn\'t interact with Maitai directly anymore in some cases as Maitai is able to poll some changes and if it finds out that the change happened it marks the state as complete. So:\\n<pbabinca> If Maitai will create a Jira issue to create a branch will it check the state of the ticket and if that ticket will be closed it will mark it as done in the process as well?\\n<wguo> sure, if there is need to do it, i can complete the draft process to add the checker part \\n<pbabinca> oh, ok.\\n<wguo> to automatically check the status of the jira issue \\n<pbabinca> And regarding the people who handle the tasks - is it for bugging if it stays open too long? Or could maitai send updates to the jira tasks instead?\\n<pbabinca> By updates I mean comments.\\n<wguo> the tasks is for you guys to decide whether the process continue ? \\n<pbabinca> Yes\\n<wguo> so what\'s your meaning for \\\"sending updates to the jira tasks\\\"?\\n<pbabinca> I\'m wondering if we could completely skip interaction with Maitai in this point - if we resolve the jira task it was accepted. If it is rejected the process should end.\\n<wguo> ok, it makes sense \\n<wguo> then i will remove all the human task from the process and set jira issue instead \\n<pbabinca> Oh right. I\'m not sure how Maitai works here. But my guess was that if somebody will find there is no progress with the Maitai process *someone* could bug people to finish tasks with *some* Maitai tooling. That would send e-mails to people who have these tasks assigned. But maybe that was a special feature which was added to the process and it cannot be done automatically.\\n<pbabinca> But regarding this bugging people - we don\'t need to handle that now.\\n<pbabinca> I see. My bad - I didn\'t know it differs between human and Jira interaction here. :/\\n<wguo> oh, sorry, human task is mean you need interaction with maitai,  : ) \\n<wguo> so users don\'t need interaction with maitai at all , all the things are handled via jira issue \\n<pbabinca> Amazing :)\\n<wguo> \\\"Please create DistGit branch:  package:guake ;   dist_git branch: eng-rhel-7\\\" is it ok for the issue description, im the first time to reach dist_git, \\n<wguo> so not sure whether it make sense for users \\n<wguo> i mean the description for the sample issue :   https://projects.devel.engineering.redhat.com/browse/RCM-55\\n\\n\",\"attribs\":\"*0|p+1tb*0+36|2+2\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.aqmWL9r2gCNjVozF\"]},\"nextNum\":1},\"head\":2,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:Package_Management_Note:revs:0','{\"changeset\":\"Z:1>1x+1x$This a private pad platform which you can record what you want to! :)\",\"meta\":{\"author\":\"\",\"timestamp\":1461836765509,\"atext\":{\"text\":\"This a private pad platform which you can record what you want to! :)\\n\",\"attribs\":\"|1+1y\"}}}'),('pad:Package_Management_Note:revs:1','{\"changeset\":\"Z:1y>1uk-1x*0|p+1tb*0+36$<pbabinca> ping; wrt MAITAI-3981\\n<wguo> hey : )\\n<pbabinca> Hi, I\'d like to clarify couple of things and I guess IRC would be faster\\n<wguo> sure \\n<pbabinca> I was told people doesn\'t interact with Maitai directly anymore in some cases as Maitai is able to poll some changes and if it finds out that the change happened it marks the state as complete. So:\\n<pbabinca> If Maitai will create a Jira issue to create a branch will it check the state of the ticket and if that ticket will be closed it will mark it as done in the process as well?\\n<wguo> sure, if there is need to do it, i can complete the draft process to add the checker part \\n<pbabinca> oh, ok.\\n<wguo> to automatically check the status of the jira issue \\n<pbabinca> And regarding the people who handle the tasks - is it for bugging if it stays open too long? Or could maitai send updates to the jira tasks instead?\\n<pbabinca> By updates I mean comments.\\n<wguo> the tasks is for you guys to decide whether the process continue ? \\n<pbabinca> Yes\\n<wguo> so what\'s your meaning for \\\"sending updates to the jira tasks\\\"?\\n<pbabinca> I\'m wondering if we could completely skip interaction with Maitai in this point - if we resolve the jira task it was accepted. If it is rejected the process should end.\\n<wguo> ok, it makes sense \\n<wguo> then i will remove all the human task from the process and set jira issue instead \\n<pbabinca> Oh right. I\'m not sure how Maitai works here. But my guess was that if somebody will find there is no progress with the Maitai process *someone* could bug people to finish tasks with *some* Maitai tooling. That would send e-mails to people who have these tasks assigned. But maybe that was a special feature which was added to the process and it cannot be done automatically.\\n<pbabinca> But regarding this bugging people - we don\'t need to handle that now.\\n<pbabinca> I see. My bad - I didn\'t know it differs between human and Jira interaction here. :/\\n<wguo> oh, sorry, human task is mean you need interaction with maitai,  : ) \\n<wguo> so users don\'t need interaction with maitai at all , all the things are handled via jira issue \\n<pbabinca> Amazing :)\\n<wguo> \\\"Please create DistGit branch:  package:guake ;   dist_git branch: eng-rhel-7\\\" is it ok for the issue description, im the first time to reach dist_git, \\n<wguo> so not sure whether it make sense for users \\n<wguo> i mean the description for the sample issue :   https://projects.devel.engineering.redhat.com/browse/RCM-55\",\"meta\":{\"author\":\"a.aqmWL9r2gCNjVozF\",\"timestamp\":1461836768405}}'),('pad:Package_Management_Note:revs:2','{\"changeset\":\"Z:1wi>1|p=1tb=36|1+1$\\n\",\"meta\":{\"author\":\"\",\"timestamp\":1461836768406}}'),('pad:PDC_RELEASE','{\"atext\":{\"text\":\"https://engineering.redhat.com/rt/Ticket/Display.html?id=357355\\n\\nRT example:\\nWed Jun 17 09:00:01 2015     maitai/maitai.host.prod.eng.rdu2.redhat.com@redhat.com -  Ticket created         [Reply] [Comment]                        From:      maitai/maitai.host.prod.eng.rdu2.redhat.com@redhat.com           Subject:      [RHEL 7 RHEL] Create Package:hawkey in Build System and PkgWrangler   \\nDownload (untitled) / with headers\\ntext/plain 699b\\nPackage Name: hawkey\\nProduct: Red Hat Enterprise Linux 7\\nRelease Version: 7.2\\nChild Channel: RHEL\\nPackage Maintainer: jsilhan\\nDistribution Bug Report: https://bugzilla.redhat.com/1124420 [Open URL]\\nPackage Description:\\nComment from akozumpl:\\n\\nLibrary providing simplified C and Python API to libsolv\\n\\nPlease  create this package in the build system (a dist-git repo and branch)  and whitelist in PackageWrangler: pkgwcli whitelist-package  --product=$PRODUCT $PKG_NAME . Then set the Package Maintainer as  necessary .\\n\\nThis is an automated RT. For more information visit https://maitai.engineering.redhat.com/maitai/#process/instance/19863 [Open URL]\\nMaitai - Business Process Engine - https://maitai.engineering.redhat.com/ [Open URL]\\n\\n\\n{\\n    \\\"count\\\": 1,\\n    \\\"next\\\": null,\\n    \\\"previous\\\": null,\\n    \\\"results\\\": [\\n        {\\n            \\\"release_id\\\": \\\"rhel-7.2\\\",\\n            \\\"short\\\": \\\"rhel\\\",\\n            \\\"version\\\": \\\"7.2\\\",\\n            \\\"name\\\": \\\"Red Hat 