imestamp\":1435805917385}}'),('pad:PER_FY14_Goal','{\"atext\":{\"text\":\"Process Improvement\\n\\nBuild agile process and use retrospections as a mechanism to continously improve it.\\nMeets Expectation\\n* (Q1) learn agile and Scrum by training or knowledge share.\\n* (Q1) Start practice agile process on 1-2 projects.\\n* (Q1) Retrospections are held regularly.\\nExceeds Expectation\\n* (Q2) New best practices are documented as we learn how to do things better.\\n\\nProgress Tracking and Reporting\\n\\nImplement a lean solution to efficiently plan and execute work at team level and keep track of progress.\\nMeets Expectation\\n* (Q1) Status of bugs/tasks is kept up to date\\n* (Q2) Progress information (time estimated and spend) is captured and hence available for reporting.\\nExceeds Expectation\\n* (Q3) Work planning is done in collaboration with other parts of the HSS organization, i.e. QE, RAP & EngOps.\\n\\nImprove code quality & customer satisfaction levels\\nReduce    bugs, write good user documentation, provide good support, provide    solutions that bring value to end users, focus on the blocking issues.\\nMeets Expectation   \\n* (Q1) Git/Gerrit code reviews are done according to the HSS-IED guideline.\\n* (Q1) Use code quality management platform (sonar) in project Beacon\\n* (Q2) Regular releases are done with good release notes, user documentation.\\n* (Q2) Code Quality Management Platform process is documented if it is proved a good practice.\\n* (Q2) New bugs are triaged within 24 hr and accepted or pushed back for more info.\\n* (Q3) Support requests are responded to within 48 hrs.\\nExceeds Expectation                                   \\n* (Q2) New features have (auto-)tests that pass.\\n* (Q4) Have evidence that code quality is improved by the effort spend on this goal.\\n\\nSoftware Reusing\\n\\nReuse software to avoid duplicatd effort, improve quality and cost efficiency, \\nMeets Expectation   \\n* (Q1) A reusable code base and structure is build with clearly defined guide to allow user be able to use and contribute to it.\\n* (Q2) A process is defined to ensure we are using reusable code first instead of developing duplicated code.\\n\\nPeople\\n======\\n\\nLearning and Knowledge sharing\\n\\nAttend a seminar, training, or conference, read a technical book, and if it makes sense give a Tech Talk or LnL.\\nMeets Expectation\\n* (Q2) A required/recommanded training courses are defined for each role.\\n* (Q2) Participate in some training in Spoken English and Tech field\\n* (Q4) Present at least one tech session inside team.\\nExceeds Expectation\\n* (Q2) Consistently sharing knowledge and experience with other team members\\n* (Q4) Always improving your skills and knowledge\\n \\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\",\"attribs\":\"|55+234\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.3vPDX6e0kV4NZblh\"],\"1\":[\"author\",\"\"]},\"nextNum\":2},\"head\":2,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:PER_FY14_Goal:revs:0','{\"changeset\":\"Z:1>1x+1x$This a private pad platform which you can record what you want to! :)\",\"meta\":{\"author\":\"\",\"timestamp\":1387360961679,\"atext\":{\"text\":\"This a private pad platform which you can record what you want to! :)\\n\",\"attribs\":\"|1+1y\"}}}'),('pad:PER_FY14_Goal:revs:1','{\"changeset\":\"Z:1y>216-1x*0|54+233$Process Improvement\\n\\nBuild agile process and use retrospections as a mechanism to continously improve it.\\nMeets Expectation\\n* (Q1) learn agile and Scrum by training or knowledge share.\\n* (Q1) Start practice agile process on 1-2 projects.\\n* (Q1) Retrospections are held regularly.\\nExceeds Expectation\\n* (Q2) New best practices are documented as we learn how to do things better.\\n\\nProgress Tracking and Reporting\\n\\nImplement a lean solution to efficiently plan and execute work at team level and keep track of progress.\\nMeets Expectation\\n* (Q1) Status of bugs/tasks is kept up to date\\n* (Q2) Progress information (time estimated and spend) is captured and hence available for reporting.\\nExceeds Expectation\\n* (Q3) Work planning is done in collaboration with other parts of the HSS organization, i.e. QE, RAP & EngOps.\\n\\nImprove code quality & customer satisfaction levels\\nReduce    bugs, write good user documentation, provide good support, provide    solutions that bring value to end users, focus on the blocking issues.\\nMeets Expectation   \\n* (Q1) Git/Gerrit code reviews are done according to the HSS-IED guideline.\\n* (Q1) Use code quality management platform (sonar) in project Beacon\\n* (Q2) Regular releases are done with good release notes, user documentation.\\n* (Q2) Code Quality Management Platform process is documented if it is proved a good practice.\\n* (Q2) New bugs are triaged within 24 hr and accepted or pushed back for more info.\\n* (Q3) Support requests are responded to within 48 hrs.\\nExceeds Expectation                                   \\n* (Q2) New features have (auto-)tests that pass.\\n* (Q4) Have evidence that code quality is improved by the effort spend on this goal.\\n\\nSoftware Reusing\\n\\nReuse software to avoid duplicatd effort, improve quality and cost efficiency, \\nMeets Expectation   \\n* (Q1) A reusable code base and structure is build with clearly defined guide to allow user be able to use and contribute to it.\\n* (Q2) A process is defined to ensure we are using reusable code first instead of developing duplicated code.\\n\\nPeople\\n======\\n\\nLearning and Knowledge sharing\\n\\nAttend a seminar, training, or conference, read a technical bo