rs to transform higher education models for colleges and\\n\\nuniversities so that more students graduate at higher rates with\\n\\nhigh-quality degrees or certificates at an affordable price\\n\\n \\nwe focus our time and energy on innovative solutions that keep students on the right track\\n\\nincluding technology that makes teaching and learning smarter and pathways that\\n\\nprovide students a clear route to a credential on powerful incentives that\\n\\ndrive widespread adoption of those solutions including financial aid that\\n\\nhelps more students get to and through college and data and information that\\n\\nempower better decision-making and on robust networks of institutions and\\n\\norganizations that are committed to advancing equity and sustainability\\n\\nthrough innovation and collaboration \\n\\n\\nour vision as a US higher education system that propels social mobility and economic development and we\'re working\\n\\nhard to make it a reality\\n\\n\",\"attribs\":\"*0|19+11w*0+p|2+2\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.3y5Xi9jHVYSqllix\"]},\"nextNum\":1},\"head\":106,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:postsecondary_success:revs:0','{\"changeset\":\"Z:1>6k|5+6k$Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\",\"meta\":{\"author\":\"\",\"timestamp\":1501658754928,\"atext\":{\"text\":\"Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\\n\",\"attribs\":\"|6+6l\"}}}'),('pad:postsecondary_success:revs:1','{\"changeset\":\"Z:6l>w7|4-4x-1m*0|20+121*0+p$despite its deserved reputation as the\\n\\ngrea