h\",\"timestamp\":1387442036134}}'),('pad:PRO_MAITAI_Handover:revs:9','{\"changeset\":\"Z:a2>1|8=9x*0+1$5\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387442037207}}'),('pad:PRO_MAITAI_LocalRun','{\"atext\":{\"text\":\"(ref : https://engineering.redhat.com/trac/maitai/wiki/Development%20guide\\nand https://engineering.redhat.com/trac/maitai/wiki/DeploymentGuide)\\nsection Create DevLocal Environment and section H2 Console\\n\\n*mvn clean install -Dmaven.test.skip=true -P devLocal\\n\\n1. add the following content to standalone-full.xml ,  the files users.properties and roles.properties will ref the files in maitai-server-web/src/main/resources/   (can modify the value to ref other properties )\\n <security-domain name=\\\"REDHAT.COM\\\">\\n                    <authentication>\\n                        <login-module code=\\\"UsersRoles\\\" flag=\\\"required\\\">\\n                            <module-option name=\\\"usersProperties\\\" value=\\\"users.properties\\\"/>\\n                            <module-option name=\\\"rolesProperties\\\" value=\\\"roles.properties\\\"/>\\n                        </login-module>\\n                    </authentication>\\n                </security-domain>             \\n===note=== \\n if  you use the as7 in eclipse , how to switch the default standalone.xml  to standalone-full.xml , double click the server as7 , click \\\"Open  launch configuration\\\" , change the default param in Program arguments : --server-config=standalone-full.xml \\n                \\n2. jboss-web.xml\\n<jboss-web>\\n    <security-domain>java:/jaas/REDHAT.COM</security-domain>\\n    <disable-audit>true</disable-audit>\\n    <context-root>maitai</context-root>\\n     <!--  <valve><class-name>com.redhat.engineering.maitai.web.MaitaiNegotiationAuthenticator</class-name></valve>-->\\n</jboss-web>\\n3. web.xml   \\n    <login-config>\\n        <auth-method>FORM</auth-method>\\n        <realm-name>REDHAT.COM</realm-name>\\n        <form-login-config>\\n            <form-login-page>/login.html</form-login-page>\\n            <form-error-page>/login_error.html</form-error-page>\\n        </form-login-config>\\n    </login-config>\\n4. remove dom4j.jar from lib\\n5. add dom4j dependencies to file MANIFEST.MF\\n     Dependencies: org.dom4j\\n6.  add the following param to as7 in eclipse \\n*Currently Maitai does not have any role mapping, any authenticated user should be able to use it. \\n*In order to disable role restriction on EAP6?AS7? the following system property has to be added to the start-up script: \\n-Dorg.apache.catalina.realm.RealmBase.ALL_ROLES_MODE=strictAuthOnly\\n===note=== \\ndouble click the server as7 , click \\\"Open launch configuration\\\" and add the above config to VM arguments\\n\\n\\n===============use content of jboss =====mavel deploy as plugin======================\\nor :   mvn clean install -Dmaven.test.skip=true  -Pmaitai-deploy -Dusername=wguo -Dpassword=admin -PdevLocal\\n\\n\",\"attribs\":\"|2+40+7*1+1*1*7+r+c*1+1*1*7+a|2+2*0*b*3*5+1*1*7+1g|2+2*1+w*1*9+j*1+e*1*9+g*1+5*1*9+g*1+32|3+23+18*9+a|6+97*2+b|1+1*2+5z*9*2+11|2+i*1*9+g|2+d+l*9+l|5+6f*1*9+a*9+3|1+1+4*7|1+f*7+l*9+4*7|1+f*7+k*9+a*7|5+5f*7+j|1+1*1*9+s|1+1*1+7*1*9+5*1+l*1*9+c|1+1*1*9+s*9|1+1*1*9+1a|1+1*3*4*5+1*2+2q|1+1*3*4*5+1*2+3c|2+1x*2+b|1+1*2+2w|3+3*1*7|1+2e*1*7+30|2+2\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.3vPDX6e0kV4NZblh\"],\"1\":[\"bold\",\"true\"],\"2\":[\"italic\",\"true\"],\"3\":[\"insertorder\",\"first\"],\"4\":[\"list\",\"bullet2\"],\"5\":[\"lmkr\",\"1\"],\"6\":[\"author\",\"\"],\"7\":[\"colors\",\"green\"],\"8\":[\"colors\",\"orange\"],\"9\":[\"colors\",\"red\"],\"10\":[\"heading\",\"h1\"],\"11\":[\"heading\",\"h2\"],\"12\":[\"colors\",\"blue\"]},\"nextNum\":13},\"head\":30,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:PRO_MAITAI_LocalRun:revs:0','{\"changeset\":\"Z:1>1x+1x$This a private pad platform which you can record what you want to! :)\",\"meta\":{\"a