otiationAuthenticator</class-name></valve>-->\\n</jboss-web>\\n3. web.xml   \\n    <login-config>\\n        <auth-method>FORM</auth-method>\\n        <realm-name>REDHAT.COM</realm-name>\\n        <form-login-config>\\n            <form-login-page>/login.html</form-login-page>\\n            <form-error-page>/login_error.html</form-error-page>\\n        </form-login-config>\\n    </login-config>\\n4. remove dom4j.jar from lib\\n5. add dom4j dependencies to file MANIFEST.MF\\n     Dependencies: org.dom4j\\n6.  add the following param to as7 in eclipse \\n*Currently Maitai does not have any role mapping, any authenticated user should be able to use it. \\n*In order to disable role restriction on EAP6?AS7? the following system property has to be added to the start-up script: \\n-Dorg.apache.catalina.realm.RealmBase.ALL_ROLES_MODE=strictAuthOnly\\n===note=== \\ndouble click the server as7 , click \\\"Open launch configuration\\\" and add the above config to VM arguments\\n\\n\\n===============use content of jboss =====mavel deploy as plugin======================\\nor :   mvn clean install -Dmaven.test.skip=true  -Pmaitai-deploy -Dusername=wguo -Dpassword=admin -PdevLocal\\n\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387359965996}}'),('pad:PRO_MAITAI_LocalRun:revs:10','{\"changeset\":\"Z:1zx>0|4=5o*b=1$\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387360006183}}'),('pad:PRO_MAITAI_LocalRun:revs:11','{\"changeset\":\"Z:1zx>0|4=5o=1*7=1g$\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387360015069}}'),('pad:PRO_MAITAI_LocalRun:revs:12','{\"changeset\":\"Z:1zx>0|6=77=w*9=j$\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387360026406}}'),('pad:PRO_MAITAI_LocalRun:revs:13','{\"changeset\":\"Z:1zx>0|6=77=1t*9=g$\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387360031391}}'),('pad:PRO_MAITAI_LocalRun:revs:14','{\"changeset\":\"Z:1zx>0|6=77=2e*9=g$\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp