configuration.xml\\n--------------------------------\\n<webui-configuration>  \\n  <annotation-classes>\\n  </annotation-classes>  \\n   \\n  <application>     \\n    <ui-component-root>com.redhat.tools.toolbar.webui.component.UIUserInfoPortlet</ui-component-root>    \\n    <state-manager>org.exoplatform.webui.application.portlet.ParentAppStateManager</state-manager>\\n    <application-lifecycle-listeners>       \\n      <listener>org.exoplatform.portal.application.PortletStatisticLifecycle</listener>       \\n    </application-lifecycle-listeners>\\n  </application>\\n</webui-configuration>\\n--------------------------------------\\nstep3:\\ncreate java class:\\np360-extension/src/main/java/com/redhat/tools/toolbar/webui/component/UIUserInfoPortlet.java\\n---------------------------------------------------\\n@ComponentConfig(lifecycle  = UIApplicationLifecycle.class, template =  \\\"app:/groovy/admintoolbar/webui/component/UIUserInfoPortlet.gtmpl\\\")\\npublic class UIUserInfoPortlet extends UIPortletApplication\\n{\\n \\n   public UIUserInfoPortlet() throws Exception\\n   {\\n   }\\n \\n   public User getUser()\\n   {\\n      ConversationState state = ConversationState.getCurrent();\\n      return (User)state.getAttribute(CacheUserProfileFilter.USER_PROFILE);\\n   }\\n}\\n-------------------------------------------------------\\nadd dependency to pom:\\n-------------------------------------\\n<dependencies>\\n        <dependency>\\n            <groupId>org.exoplatform.portal</groupId>\\n            <artifactId>exo.portal.webui.portal</artifactId>\\n            <version>3.0.0-GA</version>\\n            <scope>provided</scope>\\n        </dependency>\\n\\n        <dependency>\\n            <groupId>org.exoplatform.portal</groupId>\\n            <artifactId>exo.portal.webui.eXo</artifactId>\\n            <version>3.0.0-GA</version>\\n            <scope>provided</scope>\\n        </dependency>\\n    </dependencies> \\n--------------------------------------------\\n\\n