n (User)state.getAttribute(CacheUserProfileFilter.USER_PROFILE);\\n   }\\n}\\n-------------------------------------------------------\\nadd dependency to pom:\\n-------------------------------------\\n<dependencies>\\n        <dependency>\\n            <groupId>org.exoplatform.portal</groupId>\\n            <artifactId>exo.portal.webui.portal</artifactId>\\n            <version>3.0.0-GA</version>\\n            <scope>provided</scope>\\n        </dependency>\\n\\n        <dependency>\\n            <groupId>org.exoplatform.portal</groupId>\\n            <artifactId>exo.portal.webui.eXo</artifactId>\\n            <version>3.0.0-GA</version>\\n            <scope>provided</scope>\\n        </dependency>\\n    </dependencies> \\n--------------------------------------------\\n\\nstep4:\\ncreate template file:\\np360-extension/src/main/webapp/groovy/admintoolbar/webui/component/UIUserInfoPortlet.gtmpl\\n------------------------------------------------------\\n<%    \\n    import org.exoplatform.services.organization.User;\\n        \\n    def rcontext = _ctx.getRequestContext();\\n    \\n     String accountSetting =  \\\"javascript:if(document.getElementById(\'UIMaskWorkspace\'))  ajaxGet(eXo.env.server.createPortalURL(\'UIPortal\', \'AccountSettings\',  true));\\\"\\n%>\\n<div class=\\\"UIUserInfoPortlet\\\" id=\\\"$uicomponent.id\\\">\\n    <div class=\\\"Name\\\">\\n    <% if(rcontext.getRemoteUser() != null) { %>\\n        <a href=\\\"$accountSetting\\\"><%=uicomponent.getUser().getFullName()%></a>\\n    <%} else {%>\\n        <span></span>\\n    <%}%>\\n    <a href=\\\"#\\\" onclick=\\\"eXo.portal.logout();\\\" class=\\\"SignOutIcon\\\">Sign out</a>\\n    </div>\\n</div>\\n--------------------------------------------------------\\n\\nstep5:  create file sharedlayout.xml to override the origin sharedlayout.xml in  gatein.ear/02portal.war/WEB-INF/conf/portal/portal/sharedlayout.xml\\n\\nmodify the context of the tag <application-ref> of UserInfoPortlet from exoadmin to p360-ext\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387360282706}}'),('pad:PRO_P360_PortalExtend:revs:2','{\"changeset\":\"Z:4b6>0*2|4e=4b5$\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387360286861}}'),('pad:PRO_P360_ResearchAutoConfig','{\"atext\":{\"text\":\"on search ,  \\n\\nsome questions about the auto config of beacon need to talk about with you\\n\\nAs  the reference guide i have read , all of the config files will be used  to create an initial navigation . That information will then be stored  in the JCR  content repository and can be modified and managed from the  portal UI. \\nSo  now there are 2 issues , 1 , if we use the config method , we should  remove all of the tables in database jcr and idm when upgrade each time ,  and the users registed will be lost \\n2.   i have tested the method , \\n\\nSo if we use the portal ui to modify the system , is there any issues ? \\n\\n\\n.:wguo:. mkeir, ping\\n»» rglasz_lunch is now known as rglasz\\n<mkeir> wguo, pong\\n.:wguo:. hi mkeir   just want to talk about the auto config of beacon \\n.:wguo:.  mkeir, because it\'s still on research and may some issues should be  resolved , so what about continue to use the Portal UI to change some  configs in this release\\n.:wguo:. mkeir, just modify the visibility attribute of each bu \\n<mkeir> wguo, when is the package drop to QE due?\\n.:wguo:. mkeir, end of this week ,  about the auto config pages of portal , it may depend on the epp version we used \\n<mkeir>  wguo, ah, that\'s a tight timeline for something requiring more  research.  ok, guess this will be the last manual config change release  then.  please note I will make it a blocking issue for the release after  this one.\\n.:wguo:. mkeir, this version we used now may not support the increment config , ok , i will note it in the deploy guide \\n\\n\\n\\n\",\"attribs\":\"|o+16i\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.3vPDX6e0kV4NZblh\"],\"1\":[\"author\",\"\"]},\"nextNum\":2},\"head\":2,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:PRO_P360_ResearchAutoConfig:revs:0','{\"changeset\":\"Z:1>1x+1x$This a private pad platform which you can record what you want to! :)\",\"meta\":{\"author\":\"\",\"timestamp\":1387359848941,\"atext\":{\"text\":\"This a private pad platform which you can record what you want to! :)\\n\",\"attribs\":\"|1+1y\"}}}'),('pad:PRO_P360_ResearchAutoConfig:revs:1','{\"changeset\":\"Z:1y>14k-1x*0|n+16h$on search ,  \\n\\nsome questions about the auto config of beacon need to talk about with you\\n\\nAs  the reference guide i have read , all of the config files will be used  to create an initial navigation . That information will then be stored  in the JCR  content repository and can be modified and managed from the  portal UI. \\nSo  now there are 2 issues , 1 , if we use the config method , we should  remove all of the tables in database jcr and idm when upgrade each time ,  and the users registed will be lost \\n2.   i have tested the method , \\n\\nSo if we use the portal ui to modify the system , is there any issues ? \\n\\n\\n.:wguo:. mkeir, ping\\n»» rglasz_lunch is now known as rglasz\\n<mkeir> wguo, pong\\n.:wguo:. hi mkeir   just want to talk about the auto config of beacon \\n.:wguo:.  mkeir, because it\'s still on research and may some issues should be  resolved , so what about continue to use the Portal UI to change some  configs in this release\\n.:wguo:. mkeir, just modify the visibility attribute of each bu \\n<mkeir> wguo, when is the package drop to QE due?\\n.:wguo:. mkeir, end of this week ,  about the auto config pages of portal , it may depend on the epp version we used \\n<mkeir>  wguo, ah, that\'s a tight timeline for something requiring more  research.  ok, guess this will be the last manual config change release  then.  please note I will make it a blocking issue for the release after  this one.\\n.:wguo:. mkeir, this version we used now may not support the increment config , ok , i will note it in the deploy guide \\n\\n\\n\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387359855126}}'),('pad:PRO_P360_ResearchAutoConfig:revs:2','{\"changeset\":\"Z:16i>0*1|n=16h$\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387359859371}}'),('pad:PRO_P360_SQL','{\"atext\":{\"text\":\"--------------------bug trend---------------\\n* bug activity counts\\nselect  sum(bug_cnt) as cnt, dt_week_str as week, \'OPENED\' as status from  v_bugzilla_version_status_sum vss where vss.version_id=:versionId and  vss.legend=\'B\' and vss.is_blocker=\'N\' and vss.status in  (\'ASSIGNED\',\'POST\',\'MODIFIED\',\'NEW\',\'ON_DEV\') group by dt_week_str order  by vss.dt_date\\n\\n--------------------capex-------------------\\nplanned :  \\n    \\n     select fiscalYear, fiscalQuarter, \'Platform\' as bu, \'Planned\' as  expCategory, sum(Planned_CapEX_USD) as amount from ( (select  dt.fiscal_year as fiscalYear, dt.fiscal_quarter as fiscalQuarter, 0 as  Planned_CapEX_USD from dimnsn.dt_dimnsn dt where dt.fiscal_year  between(select year(date_sub(concat(fiscal_year,\'-01-01\'),interval 2  year)) from dimnsn.dt_dimnsn where dt_date=curdate()) and (select  max(cpx.fiscal_year)-1 from fact.CapEX cpx) or (fiscal_year = (select  max(cpx.fiscal_year) from fact.CapEX cpx where cpx.bu_id in (1, 2)) and  fiscal_quarter<(select min(fiscal_quarter) from dimnsn.dt_dimnsn  where dt_date=curdate())) group by fiscalYear, fiscalQuarter) union all  (select cpx.fiscal_year as fiscalYear, cpx.fiscal_quarter as  fiscalQuarter, sum(cast(AES_DECRYPT(cpx.Planned_CapEX_USD,\'redhat\') as  decimal(40,20))) as amount from fact.CapEX cpx inner join  dimnsn.Business_Unit bu on cpx.bu_id = bu.id where bu.id in (1, 2) and  cpx.fiscal_year>= (select  year(date_sub(concat(fiscal_year,\'-01-01\'),interval 2 year)) from  dimnsn.dt_dimnsn where dt_date=curdate()) and  cast(AES_DECRYPT(cpx.Planned_CapEX_USD,\'redhat\') as decimal(40,20)) is  not null group by fiscalYear, fiscalQuarter)) a group by fiscalYear,  fiscalQuarter\\n\\n\\nspent:\\n    \\n    \\n     select fiscalYear, fiscalQuarter, \'Platform\' as bu, \'Spent\' as  expCategory, sum(Spent_CapEX_USD) as amount from ( (select  dt.fiscal_year as fiscalYear, dt.fiscal_quarter as fiscalQuarter, 0 as  Spent_CapEX_USD from dimnsn.dt_dimnsn dt where (dt.fiscal_year  between(select year(date_sub(concat(fiscal_year,\'-01-01\'),interval 2  year)) from dimnsn.dt_dimnsn where dt_date=curdate()) and (select  fiscal_year-1 from dimnsn.dt_dimnsn where dt_date=curdate())) or  (dt.fiscal_year = (select fiscal_year from dimnsn.dt_dimnsn where  dt_date=curdate()) and dt.fiscal_quarter <(select fiscal_quarter from  dimnsn.dt_dimnsn where dt_date=curdate())) group by fiscalYear,  fiscalQuarter) union all (select cpx.fiscal_year as fiscalYear,  cpx.fiscal_quarter as fiscalQuarter,  sum(cast(AES_DECRYPT(cpx.Spent_CapEX_USD,\'redhat\') as decimal(40,20)))  as amount from fact.CapEX cpx inner join dimnsn.Business_Unit bu on  cpx.bu_id = bu.id where bu.id in (1, 2) and ((cpx.fiscal_year  between(select year(date_sub(concat(fiscal_year,\'-01-01\'),interval 2  year)) from dimnsn.dt_dimnsn where dt_date=curdate()) and (select  fiscal_year-1 from dimnsn.dt_dimnsn where dt_date=curdate())) or  (cpx.fiscal_year = (select fiscal_year from dimnsn.dt_dimnsn where  dt_date=curdate()) and cpx.fiscal_quarter <(select fiscal_quarter  from dimnsn.dt_dimnsn where dt_date=curdate()))) and  cast(AES_DECRYPT(cpx.Spent_CapEX_USD,\'redhat\') as decimal(40,20)) is not  null group by fiscalYear, fiscalQuarter)) a group by fiscalYear,  fiscalQuarter\\n\\n\\n------------------------timeline----------------------------\\nselect \\n    v.id as releaseId,\\n    v.product_id as productId,\\n    v.risk_flag as riskStatus,\\n    v.bug_product as product,\\n    v.name as releaseName,\\n    v.supportStartDate,\\n    v.supportEndDate,\\n    t.actual_start as actualGAStart,\\n    t.plan_start as planGAStart\\nfrom\\n    (select \\n        id,\\n            product_id,\\n            risk_flag,\\n            ifnull(bug_product, (select \\n                    PP_Products\\n                from\\n                    dimnsn.pp_timeline_mapping\\n                where\\n                    PP_Versions = name)) as bug_product,\\n            name,\\n            case\\n                when sec_support_start_date is null then str_to_date(\'Jan-01-1992 00:00:00\', \'%b-%d-%Y %H:%i:%s\')\\n                else sec_support_start_date\\n            end as supportStartDate,\\n            case\\n                when sec_support_end_date is null then str_to_date(\'Jan-01-1992 00:00:00\', \'%b-%d-%Y %H:%i:%s\')\\n                else sec_support_end_date\\n            end as supportEndDate\\n    from\\n        fact.p_versions_current\\n    where\\n        product_id = 26\\n            and schedule_url is not null) v\\n        left outer join\\n    (select \\n        version_id, actual_start, plan_start\\n    from\\n        fact.p_tasks\\n    where\\n        (name = \'GA Release\'\\n            or name = \'3.1 GA Release\')\\n    group by version_id , actual_start , plan_start) t ON v.id = t.version_id\\norder by supportStartDate desc\\n\\n\\nSELECT * FROM fact.gss_product_gadate where productId=26;\\nselect  releaseId, productId, riskStatus, product, releaseName,  supportStartDate, supportEndDate, actualGAStart, planGAStart from  fact.gss_product_gadate where productId=26\\n\\n-------------------------------Customer Support -----------------------------------------------\\n-- EXPLAIN \\n SELECT \\n    d.fiscal_year fy,\\n    d.fiscal_quarter fquar,\\n    sum(case\\n        when type_in = \'in\' and origin = \'Phone\' Then 1\\n        Else 0\\n    END) as callIn,\\n    sum(case\\n        when type_out = \'out\' and origin = \'Phone\' Then 1\\n        Else 0\\n    END) as callOut,\\n    sum(case\\n        when type_in = \'in\' and origin = \'Web\' Then 1\\n        Else 0\\n    END) as ticketIn,\\n    sum(case\\n        when type_out = \'out\' and origin = \'Web\' Then 1\\n        Else 0\\n    END) as ticketOut\\nFROM\\n    fact.Customer_Case c\\n        left join\\n    fact.Customer_Support s ON c.id = s.customer_case_id\\n        left join\\n    dimnsn.dt_dimnsn d ON s.dt_dimnsn_id = d.id\\n        left join\\n    dimnsn.prod_dimnsn p ON p.product = c.product\\nWHERE\\n    (origin = \'Phone\' or origin = \'Web\') and \\n p.id = 1\\ngroup by d.fiscal_year , d.fiscal_quarter \\n\\n-------------------------------Key Index-------------------------------------------------\\nselect distinct\\n    keyindexbu0_.bug_id as col_0_0_\\nfrom\\n    fact.p_key_index_bug keyindexbu0_\\nwhere\\n    keyindexbu0_.version_id = 29\\n        and concat(keyindexbu0_.dt_year,\\n            \'-\',\\n            keyindexbu0_.dt_week) = \'2012-48\';\\nselect distinct\\n    keyindexbu0_.bug_id as col_0_0_\\nfrom\\n    fact.p_key_index_bug keyindexbu0_\\nwhere\\n    keyindexbu0_.version_id = 29\\n        and concat(keyindexbu0_.dt_year,\\n            \'-\',\\n            keyindexbu0_.dt_week) = \'2012-48\'\\n        and keyindexbu0_.from_customer = \'Y\'\\n        \\n        \\n        ---------------------test----------------\\nselect  distinct keyindexbu0_.bug_id as col_0_0_ from p_key_index_bug  keyindexbu0_ where keyindexbu0_.version_id=140 and  concat(keyindexbu0_.dt_year, \'-\', keyindexbu0_.dt_week)=\'2013-23\'\\nselect  distinct keyindexbu0_.bug_id as col_0_0_ from p_key_index_bug  keyindexbu0_ where keyindexbu0_.version_id=140 and  concat(keyindexbu0_.dt_year, \'-\', keyindexbu0_.dt_week)=\'2013-24\'\\n\\n\\nselect  keyindexbu0_.id as id152_, keyindexbu0_.bug_id as bug2_152_,  keyindexbu0_.dt_date as dt3_152_, keyindexbu0_.dt_week as dt4_152_,  keyindexbu0_.dt_year as dt5_152_, keyindexbu0_.from_customer as  from6_152_, keyindexbu0_.open_blocker_plus as open7_152_,  keyindexbu0_.open_bug as open8_152_, keyindexbu0_.open_on_qa as  open9_152_, keyindexbu0_.open_regression as open10_152_,  keyindexbu0_.version_id as version11_152_ from p_key_index_bug  keyindexbu0_ where keyindexbu0_.version_id=140 and  concat(keyindexbu0_.dt_year, \'-\', keyindexbu0_.dt_week)=\'2013-23\'\\nselect  keyindexbu0_.id as id152_, keyindexbu0_.bug_id as bug2_152_,  keyindexbu0_.dt_date as dt3_152_, keyindexbu0_.dt_week as dt4_152_,  keyindexbu0_.dt_year as dt5_152_, keyindexbu0_.from_customer as  from6_152_, keyindexbu0_.open_blocker_plus as open7_152_,  keyindexbu0_.open_bug as open8_152_, keyindexbu0_.open_on_qa as  open9_152_, keyindexbu0_.open_regression as open10_152_,  keyindexbu0_.version_id as version11_152_ from p_key_index_bug  keyindexbu0_ where keyindexbu0_.version_id=140 and  concat(keyindexbu0_.dt_year, \'-\', keyindexbu0_.dt_week)=\'2013-24\'\\n\\n\\n\\n\\n-----------------open bug trend by fy -----------------\\nselect \\n    fiscalYear,\\n    fiscalQuarter,\\n    ppProduct,\\n    bzProduct,\\n    sum(amount) as amount\\nfrom\\n    ((select \\n        dt.fiscal_year as fiscalYear,\\n            dt.fiscal_quarter as fiscalQuarter,\\n            a.product as ppProduct,\\n            a.name as bzProduct,\\n            0 as amount\\n    from\\n        dimnsn.dt_dimnsn dt, (select \\n        d.name as product, bg.name\\n    from\\n        fact.p_versions v\\n    inner join fact.p_products_current d ON v.product_id = d.id\\n    inner join fact.p_classifications p ON d.classification_id = p.id\\n    left join dimnsn.v_PP_Bugzilla_Product_Mapping m ON d.name = m.PP_Products\\n    inner join dimnsn.bugzilla_products bg ON COALESCE(v.bug_product, m.Bugzilla_Product_Name) = bg.name\\n    where\\n        d.id = 26\\n    group by d.name , bg.name) a\\n    where\\n        (dt.fiscal_year between (select \\n                year(date_sub(concat(fiscal_year, \'-01-01\'), interval 2 year))\\n            from\\n                dimnsn.dt_dimnsn\\n            where\\n                dt_date = curdate()) and (select \\n                max(dt.fiscal_year) - 1\\n            from\\n                fact.open_bug_trend_detail tr\\n            inner join dimnsn.dt_dimnsn dt ON tr.dt_dimnsn_id = dt.id\\n            where\\n                tr.prod_dimnsn_id = 26)\\n            or (fiscal_year = (select \\n                max(dt.fiscal_year)\\n            from\\n                fact.open_bug_trend_detail tr\\n            inner join dimnsn.dt_dimnsn dt ON tr.dt_dimnsn_id = dt.id\\n            where\\n                tr.prod_dimnsn_id = 26)\\n            and fiscal_quarter < (select \\n                min(fiscal_quarter)\\n            from\\n                dimnsn.dt_dimnsn\\n            where\\n                dt_date = curdate())))\\n    group by dt.fiscal_year , dt.fiscal_quarter , a.product , a.name) union (select \\n        dt.fiscal_year as fiscalYear,\\n            dt.fiscal_quarter as fiscalQuarter,\\n            pr.product as ppProduct,\\n            bp.name as bzProduct,\\n            count(1) as amount\\n    from\\n        fact.open_bug_trend_detail tr\\n    inner join dimnsn.dt_dimnsn dt ON tr.dt_dimnsn_id = dt.id\\n    inner join dimnsn.prod_dimnsn_current pr ON tr.prod_dimnsn_id = pr.id\\n    inner join dimnsn.bugzilla_products bp ON tr.bugzilla_prod_id = bp.id\\n    where\\n        pr.id = 26\\n            and tr.bug_status in (\'NEW\' , \'ASSIGNED\', \'MODIFIED\', \'ON_DEV\', \'POST\')\\n            and dt.fiscal_year >= (select \\n                year(date_sub(concat(fiscal_year, \'-01-01\'), interval 2 year))\\n            from\\n                dimnsn.dt_dimnsn\\n            where\\n                dt_date = curdate())\\n    group by dt.fiscal_year , dt.fiscal_quarter , pr.product , bp.name)) a\\ngroup by fiscalYear , fiscalQuarter , ppProduct , bzProduct\\norder by fiscalYear , fiscalQuarter , bzProduct\\n\\n\\n\\n\\n-------------------\\nselect \\n        d.id,d.name as product, v.bug_product,m.Bugzilla_Product_Name\\n    from\\n        fact.p_versions v\\n    inner join fact.p_products_current d ON v.product_id = d.id\\n    inner join fact.p_classifications p ON d.classification_id = p.id\\n    left join dimnsn.v_PP_Bugzilla_Product_Mapping m ON d.name = m.PP_Products\\n    where\\n        d.id = 2;\\n\\nselect * from dimnsn.bugzilla_products bg where bg.name like \'%OpenShift%\'\\n\\n\\nselect \\n      /*  d.id,d.name as product,v.name as version,v.bug_product, m.Bugzilla_Product_Name*/\\ndistinct(d.name),d.id\\n    from\\n        fact.p_versions v\\n    inner join fact.p_products_current d ON v.product_id = d.id\\n    inner join fact.p_classifications p ON d.classification_id = p.id\\n    left join dimnsn.v_PP_Bugzilla_Product_Mapping m ON d.name = m.PP_Products\\nwhere not exists (\\nselect 1 from dimnsn.bugzilla_products bg where COALESCE(v.bug_product, m.Bugzilla_Product_Name) = bg.name\\n);\\n\\n\\n\\n==============All bu headcount=\\nSELECT \\n    f.func_name as func,\\n    c.fiscal_year as fy,\\n    c.fiscal_quarter as quarter,\\n    count(1) as plan,\\n    sum(case\\n        when c.ishired = \'Y\' then 1\\n        else 0\\n    end) as act\\nFROM\\n    fact.HR_Recruitement c\\n        LEFT JOIN\\n    dimnsn.oc_func_dimnsn f ON c.func_id = f.id\\nGROUP BY c.func_id , c.fiscal_year , c.fiscal_quarter\\n\\n\\n\\n\\n\\n\",\"attribs\":\"*0|g+2hf*0*1+1o*0|1f+19x*0*1+2n*0|5d+5k9|1+1\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.3vPDX6e0kV4NZblh\"],\"1\":[\"bold\",\"true\"]},\"nextNum\":2},\"head\":1,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:PRO_P360_SQL:revs:0','{\"changeset\":\"Z:1>1x+1x$This a private pad platform which you can record what you want to! :)\",\"meta\":{\"author\":\"\",\"timestamp\":1387361122374,\"atext\":{\"text\":\"This a private pad platform which you can record what you want to! :)\\n\",\"attribs\":\"|1+1y\"}}}'),('pad:PRO_P360_SQL:revs:1','{\"changeset\":\"Z:1y>9dz-1x*0|g+2hf*0*1+1o*0|1f+19x*0*1+2n*0|5d+5k9$--------------------bug trend---------------\\n* bug activity counts\\nselect  sum(bug_cnt) as cnt, dt_week_str as week, \'OPENED\' as status from  v_bugzilla_version_status_sum vss where vss.version_id=:versionId and  vss.legend=\'B\' and vss.is_blocker=\'N\' and vss.status in  (\'ASSIGNED\',\'POST\',\'MODIFIED\',\'NEW\',\'ON_DEV\') group by dt_week_str order  by vss.dt_date\\n\\n--------------------capex-------------------\\nplanned :  \\n    \\n     select fiscalYear, fiscalQuarter, \'Platform\' as bu, \'Planned\' as  expCategory, sum(Planned_CapEX_USD) as amount from ( (select  dt.fiscal_year as fiscalYear, dt.fiscal_quarter as fiscalQuarter, 0 as  Planned_CapEX_USD from dimnsn.dt_dimnsn dt where dt.fiscal_year  between(select year(date_sub(concat(fiscal_year,\'-01-01\'),interval 2  year)) from dimnsn.dt_dimnsn where dt_date=curdate()) and (select  max(cpx.fiscal_year)-1 from fact.CapEX cpx) or (fiscal_year = (select  max(cpx.fiscal_year) from fact.CapEX cpx where cpx.bu_id in (1, 2)) and  fiscal_quarter<(select min(fiscal_quarter) from dimnsn.dt_dimnsn  where dt_date=curdate())) group by fiscalYear, fiscalQuarter) union all  (select cpx.fiscal_year as fiscalYear, cpx.fiscal_quarter as  fiscalQuarter, sum(cast(AES_DECRYPT(cpx.Planned_CapEX_USD,\'redhat\') as  decimal(40,20))) as amount from fact.CapEX cpx inner join  dimnsn.Business_Unit bu on cpx.bu_id = bu.id where bu.id in (1, 2) and  cpx.fiscal_year>= (select  year(date_sub(concat(fiscal_year,\'-01-01\'),interval 2 year)) from  dimnsn.dt_dimnsn where dt_date=curdate()) and  cast(AES_DECRYPT(cpx.Planned_CapEX_USD,\'redhat\') as decimal(40,20)) is  not null group by fiscalYear, fiscalQuarter)) a group by fiscalYear,  fiscalQuarter\\n\\n\\nspent:\\n    \\n    \\n     select fiscalYear, fiscalQuarter, \'Platform\' as bu, \'Spent\' as  expCategory, sum(Spent_CapEX_USD) as amount from ( (select  dt.fiscal_year as fiscalYear, dt.fiscal_quarter as fiscalQuarter, 0 as  Spent_CapEX_USD from dimnsn.dt_dimnsn dt where (dt.fiscal_year  between(select year(date_sub(concat(fiscal_year,\'-01-01\'),interval 2  year)) from dimnsn.dt_dimnsn where dt_date=curdate()) and (select  fiscal_year-1 from dimnsn.dt_dimnsn where dt_date=curdate())) or  (dt.fiscal_year = (select fiscal_year from dimnsn.dt_dimnsn where  dt_date=curdate()) and dt.fiscal_quarter <(select fiscal_quarter from  dimnsn.dt_dimnsn where dt_date=curdate())) group by fiscalYear,  fiscalQuarter) union all (select cpx.fiscal_year as fiscalYear,  cpx.fiscal_quarter as fiscalQuarter,  sum(cast(AES_DECRYPT(cpx.Spent_CapEX_USD,\'redhat\') as decimal(40,20)))  as amount from fact.CapEX cpx inner join dimnsn.Business_Unit bu on  cpx.bu_id = bu.id where bu.id in (1, 2) and ((cpx.fiscal_year  between(select year(date_sub(concat(fiscal_year,\'-01-01\'),interval 2  year)) from dimnsn.dt_dimnsn where dt_date=curdate()) and (select  fiscal_year-1 from dimnsn.dt_dimnsn where dt_date=curdate())) or  (cpx.fiscal_year = (select fiscal_year from dimnsn.dt_dimnsn where  dt_date=curdate()) and cpx.fiscal_quarter <(select fiscal_quarter  from dimnsn.dt_dimnsn where dt_date=curdate()))) and  cast(AES_DECRYPT(cpx.Spent_CapEX_USD,\'redhat\') as decimal(40,20)) is not  null group by fiscalYear, fiscalQuarter)) a group by fiscalYear,  fiscalQuarter\\n\\n\\n------------------------timeline----------------------------\\nselect \\n    v.id as releaseId,\\n    v.product_id as productId,\\n    v.risk_flag as riskStatus,\\n    v.bug_product as product,\\n    v.name as releaseName,\\n    v.supportStartDate,\\n    v.supportEndDate,\\n    t.actual_start as actualGAStart,\\n    t.plan_start as planGAStart\\nfrom\\n    (select \\n        id,\\n            product_id,\\n            risk_flag,\\n            ifnull(bug_product, (select \\n                    PP_Products\\n                from\\n                    dimnsn.pp_timeline_mapping\\n                where\\n                    PP_Versions = name)) as bug_product,\\n            name,\\n            case\\n                when sec_support_start_date is null then str_to_date(\'Jan-01-1992 00:00:00\', \'%b-%d-%Y %H:%i:%s\')\\n                else sec_support_start_date\\n            end as supportStartDate,\\n            case\\n                when sec_support_end_date is null then str_to_date(\'Jan-01-1992 00:00:00\', \'%b-%d-%Y %H:%i:%s\')\\n                else sec_support_end_date\\n            end as supportEndDate\\n    from\\n        fact.p_versions_current\\n    where\\n        product_id = 26\\n            and schedule_url is not null) v\\n        left outer join\\n    (select \\n        version_id, actual_start, plan_start\\n    from\\n        fact.p_tasks\\n    where\\n        (name = \'GA Release\'\\n            or name = \'3.1 GA Release\')\\n    group by version_id , actual_start , plan_start) t ON v.id = t.version_id\\norder by supportStartDate desc\\n\\n\\nSELECT * FROM fact.gss_product_gadate where productId=26;\\nselect  releaseId, productId, riskStatus, product, releaseName,  supportStartDate, supportEndDate, actualGAStart, planGAStart from  fact.gss_product_gadate where productId=26\\n\\n-------------------------------Customer Support -----------------------------------------------\\n-- EXPLAIN \\n SELECT \\n    d.fiscal_year fy,\\n    d.fiscal_quarter fquar,\\n    sum(case\\n        when type_in = \'in\' and origin = \'Phone\' Then 1\\n        Else 0\\n    END) as callIn,\\n    sum(case\\n        when type_out = \'out\' and origin = \'Phone\' Then 1\\n        Else 0\\n    END) as callOut,\\n    sum(case\\n        when type_in = \'in\' and origin = \'Web\' Then 1\\n        Else 0\\n    END) as ticketIn,\\n    sum(case\\n        when type_out = \'out\' and origin = \'Web\' Then 1\\n        Else 0\\n    END) as ticketOut\\nFROM\\n    fact.Customer_Case c\\n        left join\\n    fact.Customer_Support s ON c.id = s.customer_case_id\\n        left join\\n    dimnsn.dt_dimnsn d ON s.dt_dimnsn_id = d.id\\n        left join\\n    dimnsn.prod_dimnsn p ON p.product = c.product\\nWHERE\\n    (origin = \'Phone\' or origin = \'Web\') and \\n p.id = 1\\ngroup by d.fiscal_year , d.fiscal_quarter \\n\\n-------------------------------Key Index-------------------------------------------------\\nselect distinct\\n    keyindexbu0_.bug_id as col_0_0_\\nfrom\\n    fact.p_key_index_bug keyindexbu0_\\nwhere\\n    keyindexbu0_.version_id = 29\\n        and concat(keyindexbu0_.dt_year,\\n            \'-\',\\n            keyindexbu0_.dt_week) = \'2012-48\';\\nselect distinct\\n    keyindexbu0_.bug_id as col_0_0_\\nfrom\\n    fact.p_key_index_bug keyindexbu0_\\nwhere\\n    keyindexbu0_.version_id = 29\\n        and concat(keyindexbu0_.dt_year,\\n            \'-\',\\n            keyindexbu0_.dt_week) = \'2012-48\'\\n        and keyindexbu0_.from_customer = \'Y\'\\n        \\n        \\n        ---------------------test----------------\\nselect  distinct keyindexbu0_.bug_id as col_0_0_ from p_key_index_bug  keyindexbu0_ where keyindexbu0_.version_id=140 and  concat(keyindexbu0_.dt_year, \'-\', keyindexbu0_.dt_week)=\'2013-23\'\\nselect  distinct keyindexbu0_.bug_id as col_0_0_ from p_key_index_bug  keyindexbu0_ where keyindexbu0_.version_id=140 and  concat(keyindexbu0_.dt_year, \'-\', keyindexbu0_.dt_week)=\'2013-24\'\\n\\n\\nselect  keyindexbu0_.id as id152_, keyindexbu0_.bug_id as bug2_152_,  keyindexbu0_.dt_date as dt3_152_, keyindexbu0_.dt_week as dt4_152_,  keyindexbu0_.dt_year as dt5_152_, keyindexbu0_.from_customer as  from6_152_, keyindexbu0_.open_blocker_plus as open7_152_,  keyindexbu0_.open_bug as open8_152_, keyindexbu0_.open_on_qa as  open9_152_, keyindexbu0_.open_regression as open10_152_,  keyindexbu0_.version_id as version11_152_ from p_key_index_bug  keyindexbu0_ where keyindexbu0_.version_id=140 and  concat(keyindexbu0_.dt_year, \'-\', keyindexbu0_.dt_week)=\'2013-23\'\\nselect  keyindexbu0_.id as id152_, keyindexbu0_.bug_id as bug2_152_,  keyindexbu0_.dt_date as dt3_152_, keyindexbu0_.dt_week as dt4_152_,  keyindexbu0_.dt_year as dt5_152_, keyindexbu0_.from_customer as  from6_152_, keyindexbu0_.open_blocker_plus as open7_152_,  keyindexbu0_.open_bug as open8_152_, keyindexbu0_.open_on_qa as  open9_152_, keyindexbu0_.open_regression as open10_152_,  keyindexbu0_.version_id as version11_152_ from p_key_index_bug  keyindexbu0_ where keyindexbu0_.version_id=140 and  concat(keyindexbu0_.dt_year, \'-\', keyindexbu0_.dt_week)=\'2013-24\'\\n\\n\\n\\n\\n-----------------open bug trend by fy -----------------\\nselect \\n    fiscalYear,\\n    fiscalQuarter,\\n    ppProduct,\\n    bzProduct,\\n    sum(amount) as amount\\nfrom\\n    ((select \\n        dt.fiscal_year as fiscalYear,\\n            dt.fiscal_quarter as fiscalQuarter,\\n            a.product as ppProduct,\\n            a.name as bzProduct,\\n            0 as amount\\n    from\\n        dimnsn.dt_dimnsn dt, (select \\n        d.name as product, bg.name\\n    from\\n        fact.p_versions v\\n    inner join fact.p_products_current d ON v.product_id = d.id\\n    inner join fact.p_classifications p ON d.classification_id = p.id\\n    left join dimnsn.v_PP_Bugzilla_Product_Mapping m ON d.name = m.PP_Products\\n    inner join dimnsn.bugzilla_products bg ON COALESCE(v.bug_product, m.Bugzilla_Product_Name) = bg.name\\n    where\\n        d.id = 26\\n    group by d.name , bg.name) a\\n    where\\n        (dt.fiscal_year between (select \\n                year(date_sub(concat(fiscal_year, \'-01-01\'), interval 2 year))\\n            from\\n                dimnsn.dt_dimnsn\\n            where\\n                dt_date = curdate()) and (select \\n                max(dt.fiscal_year) - 1\\n            from\\n                fact.open_bug_trend_detail tr\\n            inner join dimnsn.dt_dimnsn dt ON tr.dt_dimnsn_id = dt.id\\n            where\\n                tr.prod_dimnsn_id = 26)\\n            or (fiscal_year = (select \\n                max(dt.fiscal_year)\\n            from\\n                fact.open_bug_trend_detail tr\\n            inner join dimnsn.dt_dimnsn dt ON tr.dt_dimnsn_id = dt.id\\n            where\\n                tr.prod_dimnsn_id = 26)\\n            and fiscal_quarter < (select \\n                min(fiscal_quarter)\\n            from\\n                dimnsn.dt_dimnsn\\n            where\\n                dt_date = curdate())))\\n    group by dt.fiscal_year , dt.fiscal_quarter , a.product , a.name) union (select \\n        dt.fiscal_year as fiscalYear,\\n            dt.fiscal_quarter as fiscalQuarter,\\n            pr.product as ppProduct,\\n            bp.name as bzProduct,\\n            count(1) as amount\\n    from\\n        fact.open_bug_trend_detail tr\\n    inner join dimnsn.dt_dimnsn dt ON tr.dt_dimnsn_id = dt.id\\n    inner join dimnsn.prod_dimnsn_current pr ON tr.prod_dimnsn_id = pr.id\\n    inner join dimnsn.bugzilla_products bp ON tr.bugzilla_prod_id = bp.id\\n    where\\n        pr.id = 26\\n            and tr.bug_status in (\'NEW\' , \'ASSIGNED\', \'MODIFIED\', \'ON_DEV\', \'POST\')\\n            and dt.fiscal_year >= (select \\n                year(date_sub(concat(fiscal_year, \'-01-01\'), interval 2 year))\\n            from\\n                dimnsn.dt_dimnsn\\n            where\\n                dt_date = curdate())\\n    group by dt.fiscal_year , dt.fiscal_quarter , pr.product , bp.name)) a\\ngroup by fiscalYear , fiscalQuarter , ppProduct , bzProduct\\norder by fiscalYear , fiscalQuarter , bzProduct\\n\\n\\n\\n\\n-------------------\\nselect \\n        d.id,d.name as product, v.bug_product,m.Bugzilla_Product_Name\\n    from\\n        fact.p_versions v\\n    inner join fact.p_products_current d ON v.product_id = d.id\\n    inner join fact.p_classifications p ON d.classification_id = p.id\\n    left join dimnsn.v_PP_Bugzilla_Product_Mapping m ON d.name = m.PP_Products\\n    where\\n        d.id = 2;\\n\\nselect * from dimnsn.bugzilla_products bg where bg.name like \'%OpenShift%\'\\n\\n\\nselect \\n      /*  d.id,d.name as product,v.name as version,v.bug_product, m.Bugzilla_Product_Name*/\\ndistinct(d.name),d.id\\n    from\\n        fact.p_versions v\\n    inner join fact.p_products_current d ON v.product_id = d.id\\n    inner join fact.p_classifications p ON d.classification_id = p.id\\n    left join dimnsn.v_PP_Bugzilla_Product_Mapping m ON d.name = m.PP_Products\\nwhere not exists (\\nselect 1 from dimnsn.bugzilla_products bg where COALESCE(v.bug_product, m.Bugzilla_Product_Name) = bg.name\\n);\\n\\n\\n\\n==============All bu headcount=\\nSELECT \\n    f.func_name as func,\\n    c.fiscal_year as fy,\\n    c.fiscal_quarter as quarter,\\n    count(1) as plan,\\n    sum(case\\n        when c.ishired = \'Y\' then 1\\n        else 0\\n    end) as act\\nFROM\\n    fact.HR_Recruitement c\\n        LEFT JOIN\\n    dimnsn.oc_func_dimnsn f ON c.func_id = f.id\\nGROUP BY c.func_id , c.fiscal_year , c.fiscal_quarter\\n\\n\\n\\n\\n\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387361127099}}'),('pad:PRO_VAULT_DevEnvSetup','{\"atext\":{\"text\":\"Vault Develop Env Setup for 3.0\\n\\n1. EAP6\\n(1) open http://yum.engineering.redhat.com/pub/yum/repo_files/rhel6-jboss-eap-6.repo\\n(2) create eap6.repo under /etc/yum.repo.d/\\n(3) copy content from first link to eap6.repo\\n(4) yum install jbossas-standalone\\n(5) the configuration is : /etc/jbossas/standalone/standalone-full.xml\\nnote: EAP6 can not be set up in Fedora, use AS7 instead.\\n\\n2. mysql\\n(1) create database jbossportal;\\n(2) GRANT ALL PRIVILEGES ON jbossportal.* TO \'portal\'@\'localhost\' IDENTIFIED BY \'portalpassword\' WITH GRANT OPTION;\\n(3) mysql -uportal -pportalpassword jbossportal < jbossportal.dump\\n\\n3. get source code\\n(1) configure gerrit first\\nAbout gerrit, please refer to ?Gerrit doc:https://mirrorglass.englab.nay.redhat.com/XWiki/bin/download/Main/Topic%20of%20HSS%20tools%20section%20meeting/code-review-workflow-Oct-27.pdf\\n(2) git clone gerrithost:vault.git\\n\\n4. configure datasource\\n(1) copy mysql.tar.gz in vault-web into directory of $jboss_home/modules/com and unzip\\n(2) execute $jboss_home/jboss-cli.sh and input \\\"connect\\\"\\n(3)  input  \\\"/subsystem=datasources/jdbc-driver=mysql:add(driver-name=mysql,driver-module-name=com.mysql,driver-xa-datasource-class-name=com.mysql.jdbc.jdbc\\\"\\n(4) start up jboss service and log into Administration console (need to create a user first)\\n(5) add a new datasource by clicking Profile-->Connector-->DataSources-->Add\\n(6)  input Name(VaultDS), JNDI(java:jboss/datasources/VaultDS), Connection  URL(jdbc:mysql://localhost:3307/jbossportal?useServerPrepStmts=false&amp;jdbcCompliantTruncation=false)\\n(7) enable it after creation\\n\\n5. configure conf file\\n(1) get into module/com\\n(2) mkdir -p redhat/tools/vault/conf/main\\n(3) vi redhat/tools/vault/conf/main/config.properties\\ncontent is: \\nattachmentpath=/home/data/vault/ \\nmaxsizeKbyte=102400 \\n(4) vi redhat/tools/vault/conf/main/module.xml\\ncontent is:\\n<?xml version=\\\"1.0\\\" encoding=\\\"UTF-8\\\"?>\\n<module xmlns=\\\"urn:jboss:module:1.1\\\" name=\\\"com.redhat.tools.vault.conf\\\">\\n    <resources>\\n        <resource-root path=\\\".\\\"/>\\n    </resources>\\n</module>\\n\\n\\n\\n\\n\\n\\n\",\"attribs\":\"*1+v|1e+1jx\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.3vPDX6e0kV4NZblh\"],\"1\":[\"bold\",\"true\"],\"2\":[\"author\",\"\"]},\"nextNum\":3},\"head\":2,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:PRO_VAULT_DevEnvSetup:revs:0','{\"changeset\":\"Z:1>1x+1x$This a private pad platform which you can record what you want to! :)\",\"meta\":{\"author\":\"\",\"timestamp\":1387360370710,\"atext\":{\"text\":\"This a private pad platform which you can record what you want to! :)\\n\",\"attribs\":\"|1+1y\"}}}'),('pad:PRO_VAULT_DevEnvSetup:revs:1','{\"changeset\":\"Z:1y>1iu-1x*0*1+v*0|1d+1jw$Vault Develop Env Setup for 3.0\\n\\n1. EAP6\\n(1) open http://yum.engineering.redhat.com/pub/yum/repo_files/rhel6-jboss-eap-6.repo\\n(2) create eap6.repo under /etc/yum.repo.d/\\n(3) copy content from first link to eap6.repo\\n(4) yum install jbossas-standalone\\n(5) the configuration is : /etc/jbossas/standalone/standalone-full.xml\\nnote: EAP6 can not be set up in Fedora, use AS7 instead.\\n\\n2. mysql\\n(1) create database jbossportal;\\n(2) GRANT ALL PRIVILEGES ON jbossportal.* TO \'portal\'@\'localhost\' IDENTIFIED BY \'portalpassword\' WITH GRANT OPTION;\\n(3) mysql -uportal -pportalpassword jbossportal < jbossportal.dump\\n\\n3. get source code\\n(1) configure gerrit first\\nAbout gerrit, please refer to ?Gerrit doc:https://mirrorglass.englab.nay.redhat.com/XWiki/bin/download/Main/Topic%20of%20HSS%20tools%20section%20meeting/code-review-workflow-Oct-27.pdf\\n(2) git clone gerrithost:vault.git\\n\\n4. configure datasource\\n(1) copy mysql.tar.gz in vault-web into directory of $jboss_home/modules/com and unzip\\n(2) execute $jboss_home/jboss-cli.sh and input \\\"connect\\\"\\n(3)  input  \\\"/subsystem=datasources/jdbc-driver=mysql:add(driver-name=mysql,driver-module-name=com.mysql,driver-xa-datasource-class-name=com.mysql.jdbc.jdbc\\\"\\n(4) start up jboss service and log into Administration console (need to create a user first)\\n(5) add a new datasource by clicking Profile-->Connector-->DataSources-->Add\\n(6)  input Name(VaultDS), JNDI(java:jboss/datasources/VaultDS), Connection  URL(jdbc:mysql://localhost:3307/jbossportal?useServerPrepStmts=false&amp;jdbcCompliantTruncation=false)\\n(7) enable it after creation\\n\\n5. configure conf file\\n(1) get into module/com\\n(2) mkdir -p redhat/tools/vault/conf/main\\n(3) vi redhat/tools/vault/conf/main/config.properties\\ncontent is: \\nattachmentpath=/home/data/vault/ \\nmaxsizeKbyte=102400 \\n(4) vi redhat/tools/vault/conf/main/module.xml\\ncontent is:\\n<?xml version=\\\"1.0\\\" encoding=\\\"UTF-8\\\"?>\\n<module xmlns=\\\"urn:jboss:module:1.1\\\" name=\\\"com.redhat.tools.vault.conf\\\">\\n    <resources>\\n        <resource-root path=\\\".\\\"/>\\n    </resources>\\n</module>\\n\\n\\n\\n\\n\\n\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387360379205}}'),('pad:PRO_VAULT_DevEnvSetup:revs:2','{\"changeset\":\"Z:1ks>0*2|1d=1kr$\",\"meta\":{\"author\":\"a.3vPDX6e0kV4NZblh\",\"timestamp\":1387360383211}}'),('pad:PRP8','{\"atext\":{\"text\":\"1. which binary pacakges are going baseos and others going appstream\\n2. for dependency package, may skip most of the steps\\n3. adding module maybe a simple process that can be implemented in JIRA\\n    https://projects.engineering.redhat.com/browse/RCM-27466\\n    https://projects.engineering.redhat.com/browse/RCM-29724\\n    https://projects.engineering.redhat.com/browse/RCM-32819\\n    \\n    1. addition of package into baseos/module\\n    2. addition of bare rpms into appstream\\n    3. is there a specific release flag for an appstream? \\n    4. for bare rpms into appstream,  is there a seperate brew branch for the appstream or still use rhel 8? \\n    5. is addition of packages into app stream equals addition of packages into module?\\n    6. binaries can end up in both repos\\n        e.g.: package \\\"bind\\\"\\n        src:  bind-9.11.3-7.el8+7.src.rpm\\n        https://brewweb.engineering.redhat.com/brew/buildinfo?buildID=689059\\n\\n     http://download.eng.pek2.redhat.com/nightly/latest-RHEL-8/compose/BaseOS/x86_64/os/Packages/\\n*bind-export-devel-9.11.3-7.el8+5.x86_64.rpm\\n*bind-export-libs-9.11.3-7.el8+5.x86_64.rpm \\n*\\n*http://download-node-02.eng.bos.redhat.com/nightly/latest-AppStream-8/compose/AppStream/x86_64/os/Packages/\\n* bind-9.11.3-7.el8+5.x86_64.rpm\\n* bind-chroot-9.11.3-7.el8+5.x86_64.rpm\\n* bind-devel-9.11.3-7.el8+5.x86_64.rpm\\n* bind-dyndb-ldap-11.1-6.el8+5.x86_64.rpm\\n* bind-libs-9.11.3-7.el8+5.x86_64.rpm\\n* bind-libs-lite-9.11.3-7.el8+5.x86_64.rpm\\n* bind-lite-devel-9.11.3-7.el8+5.x86_64.rpm \\n*\\n*another example: https://brewweb.engineering.redhat.com/brew/buildinfo?buildID=689108\\n7, which packages going into baseos or others going to app stream, maybe provide srpm url step, before PM review\\n   ? currently the step is before Devel review, is that ok?\\n8. stream branch?\\n    https://docs.google.com/document/d/1fwwu4ySzTGWIbNP9WHAi6JbzXibGY4IQjBYB6kN1SgE/edit#heading=h.xsn0lifrqpqi\\n9. dist-git:  http://pkgs.devel.redhat.com/cgit/rpms\\n    http://git.app.eng.bos.redhat.com/git/rcm-dist-git-utils.git/tree/src\\n10. http://git.app.eng.bos.redhat.com/git/pungi-redhat.git/tree/?h=rhel-8.0\\n11. Comps:\\n      http://git.app.eng.bos.redhat.com/git/comps.git/tree/comps-rhel-8.0.xml.in\\n      http://git.app.eng.bos.redhat.com/git/comps.git/tree/comps-appstream-8.0.xml.in\\n12. Can BaseOS/AppStream be treated as kind of ChildChannel ?\\n13. There is a new service coming that will store the mapping of SRPMs and RPMs in BaseOS/AppStream/Buildroot\\n\\n\\n\\n\\n\",\"attribs\":\"*0|1+1x*0+1d*1+4*0|2+21*1+4*0|2+3a*0+1o*1|d+ht*1*2*3*4+1*1|1+18*1*2*3*4+1*1|1+18*1*2*3*4+1*1|1+1*1*2*3*4+1*1|1+30*1*2*3*4+1*1|1+w*1*2*3*4+1*1|1+13*1*2*3*4+1*1|1+12*1*2*3*4+1*1|1+15*1*2*3*4+1*1|1+11*1*2*3*4+1*1|1+16*1*2*3*4+1*1|1+18*1*2*3*4+1*1|1+1*1*2*3*4+1*1|g+q9|1+1\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.C74fKOHhyd4iaGqO\"],\"1\":[\"author\",\"a.NcDoSgBEl5wIpvN1\"],\"2\":[\"insertorder\",\"first\"],\"3\":[\"list\",\"indent1\"],\"4\":[\"lmkr\",\"1\"]},\"nextNum\":5},\"head\":973,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:PRP8:revs:0','{\"changeset\":\"Z:1>6k|5+6k$Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\",\"meta\":{\"author\":\"\",\"timestamp\":1525874241603,\"atext\":{\"text\":\"Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nE