011%2C1359547\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1496898162770}}'),('pad:release_3.14.4_rc','{\"atext\":{\"text\":\"Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\\n\",\"attribs\":\"|6+6l\"},\"pool\":{\"numToAttrib\":{},\"nextNum\":0},\"head\":0,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:release_3.14.4_rc:revs:0','{\"changeset\":\"Z:1>6k|5+6k$Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\",\"meta\":{\"author\":\"\",\"timestamp\":1497595175315,\"atext\":{\"text\":\"Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\\n\",\"attribs\":\"|6+6l\"}}}'),('pad:RELEASE_NOTE','{\"atext\":{\"text\":\"Hi team ,\\n\\nThe PnT DevOps Maitai team is pleased to announce that release 0.26.0 is now available in production .\\n\\n\\n** What\'s new in Maitai 0.26.0 **\\n\\nAutomate RT queries for PLP processes\\nInstead of asking people to go back to maitai to check that they have done work that maitai sent to RT, now Maitai can automaticlly check the ticket\'s status for every configurable time.\\n\\nAutomate \\\"Create package in build system\\\" step\\nMaitai now support to get brew tags for specific release from PDC and then automaticlly whitelist the package into these tags in Brew. \\n\\nAutomate \\\"Add component into ACL\\\" in bugzilla\\nMaitai now support to add component into ACL automaticlly, and this will avoid the errors that user try to file errata for the package but not exsiting in the ACL list yet.\\n\\nAdd release component to PDC during PLP\\nMaitai will add the relevant component into PDC system during PLP process.\\n\\nSynchronize RHEL 6 and RHEL 7 PLP\\nNow we had make the two process have identical steps.\\n\\n\\n\\nUpdates and fixes \\nFor a list of all updates and fixes, visit https://projects.engineering.redhat.com/secure/ReleaseNote.jspa?projectId=10811&version=13439\\nFor more information on the Maitai project, visit https://docs.engineering.redhat.com/x/GYC_/ \\n \\n\\n\\nMaitai: https://maitai.engineering.redhat.com \\n\\n\",\"attribs\":\"|8+59+4d*0+s|3+1e+1x*0+5+1f*0+8|3+1e+1n*0+8+1v*0+4|6+56+1g*0+1|c+8j\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.Xp76vPB0bPDSNj3i\"],\"1\":[\"author\",\"\"]},\"nextNum\":2},\"head\":60,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:RELEASE_NOTE:revs:0','{\"changeset\":\"Z:1>1x+1x$This a private pad platform which you can record what you want to! :)\",\"meta\":{\"author\":\"\",\"timestamp\":1438766529947,\"atext\":{\"text\":\"This a private pad platform which you can record what you want to! :)\\n\",\"attribs\":\"|1+1y\"}}}'),('pad:RELEASE_NOTE:revs:1','{\"changeset\":\"Z:1y>12l-1x*0|u+138*0+1a$Hi team ,\\n\\nThe PnT DevOps Maitai team is pleased to announce that release 0.26.0 is now available in production .\\n\\n\\n** What\'s new in Maitai 0.26.0 **\\n\\nAutomate RT queries for PLP processes\\nInstead of asking people to go back to maitai to check that they have done work that maitai sent to RT, now Maitai can check if the tickets have been resolved automaticlly.\\n\\nAutomate \\\"Create package in build system\\\" step\\nMaitai now support to get brew tags for specific release from PDC and automaticlly whitelist the package into these tags. \\n\\nAutomate \\\"Add component into ACL\\\" in bugzilla\\nMaitai now support to add component into ACL automaticlly, which will avoid the errors that user try to file errata for the package not exsiting in the ACL list yet.\\n\\nAdd release component to PDC during PLP\\nMaitai will add the relevant component into PDC system during PLP process.\\n\\nSynchronize RHEL 6 and RHEL 7 PLP\\nNow we had make the two process have identical steps. \\n\\n\\n\\nUpdates and fixes \\nFor a list of all updates and fixes, visit https://projects.engineering.redhat.com/secure/ReleaseNote.jspa?projectId=10811&version=13439\\nFor more information on the Maitai project, visit https://docs.engineering.redhat.com/x/GYC_/ \\n \\nThis release would not have been possible without the support from Stanislav Ochotnicky from Enterprise Infrastructure Planning and Siddharth Nagar from Release Product Management, a big thanks to you. \\n\\nMaitai: https://maitai.engineering.redhat.com \",\"meta\":{\"author\":\"a.Xp76vPB0bPDSNj3i\",\"timestamp\":1438766533730}}'),('pad:RELEASE_NOTE:revs:10','{\"changeset\":\"Z:13w>1|8=59=42*0+1$e\",\"meta\":{\"author\":\"a.Xp76vPB0bPDSNj3i\",\"timestamp\":1438766809189}}'),('pad:RELEASE_NOTE:revs:11','{\"changeset\":\"Z:13x>1|8=59=43*0+1$t\",\"meta\":{\"author\":\"a.Xp76vPB0bPDSNj3i\",\"timestamp\":1438766809717}}'),('pad:RELEASE_NOTE:revs:12','{\"changeset\":\"Z:13y>1|8=59=44*0+1$\'\",\"meta\":{\"author\":\"a.Xp76vPB0bPDSNj3i\",\"timestamp\":1438766810191}}'),('pad:RELEASE_NOTE:revs:13','{\"changeset\":\"Z:13z>3|8=59=45*0+3$s s\",\"meta\":{\"author\":\"a.Xp76vPB0bPDSNj3i\",\"timestamp\":1438766810752}}'),('pad:RELEASE_NOTE:revs:14','{\"changeset\":\"Z:142>4|8=59=48*0+4$tatu\",\"meta\":{\"author\":\"a.Xp76vPB0bPDSNj3i\",\"timestamp\":1438766811217}}'),('pad:RELEASE_NOTE:revs:15','{\"changeset\":\"Z:146>1|8=59=4c*0+1$s\",\"meta\":{\"author\":\"a.Xp76vPB0bPDSNj3i\",\"timestamp\":1438766811720}}'),('pad:RELEASE_NOTE:revs:16','{\"changeset\":\"Z:147>1|8=59=4e*0+1$a\",\"meta\":{\"author\":\"a.Xp76vPB0bPDSNj3i\",\"timestamp\":1438766820107}}'),('pad:RELEASE_NOTE:revs:17','{\"changeset\":\"Z:148>3|8=