n\\n\",\"meta\":{\"author\":\"a.dY3mG9nVh31Oiaw0\",\"timestamp\":1519375243781}}'),('pad:RPMDIFF_ET','{\"atext\":{\"text\":\"1. CovscanCreateObserver\\n\\n2. RpmdiffRun\\n\\n3. errata_builds.rb\\n-- schedule_rpmdiff_runs  -- update_builds_from_errata -- add_builds_to_errata\\n\\n\\n--------------------\\ncovscan process\\n\\n1. create_external_test_run_for --type: covscan\\n2. if the covscan created successfully in covcan, then update test run (setting external test id),\\n3.  \\n\\n------------------------Sep 27 v1--------------------------------------------\\n\\nmodule Rpmdiff\\n\\n  def self.rpmdiff_schedule(errata)\\n    puts \\\"rpmdiff schedule...\\\"\\n    mappings_to_schedule = errata.build_mappings.for_rpms.group_by(&:brew_build)\\n\\n    candidates = mappings_to_schedule.map do |brew_build,mappings|\\n      old_release_version_builds = mappings.map{|m|\\n        {\\n          :release_version => m.release_version,\\n          :old_build => get_latest_brew_build_for_mapping(errata, m)\\n        }\\n      }\\n      [brew_build, old_release_version_builds]\\n    end\\n\\n    candidates.map do |brew_build, old_release_version_builds|\\n      old_builds_candidates = old_release_version_builds.group_by{ |b| b[:release_version] }\\n      puts \\\"old_builds_candidates: #{old_builds_candidates.inspect}\\\"\\n      schedule_run_for_candidates(errata, brew_build, old_builds_candidates)\\n    end\\n\\n  end\\n\\n  def self.get_latest_brew_build_for_mapping(errata, mapping)\\n    if errata.is_pdc?\\n      old_build = PdcReleasedPackage.latest_released_brew_build_for_build_mapping(mapping)\\n    else\\n      old_build = ReleasedPackage.latest_released_brew_build_for_build_mapping(mapping)\\n    end\\n  end\\n\\n  def self.schedule_run_for_candidates(errata, brew_build, old_builds_candidates)\\n    old_builds_candidates.map do |release_version, old_builds|\\n      prior = find_prior_rpmdiff_run(errata, release_version, brew_build)\\n      if prior.present?\\n        baseline_brew_build = prior.brew_build\\n      else\\n        baseline_brew_build = get_latest_old_build(old_builds)\\n      end\\n      puts \\\">>>>>>>>>>>>>>>>>>new_version: #{brew_build.nvr}\\\"\\n      puts \\\"---------->>>>>>>base_line: #{baseline_brew_build.nvr}\\\"\\n      # Create external test run\\n      new_test_run = errata.create_external_test_run_for(:covscan,\\n                                                        :brew_build_id => brew_build)\\n      # Send rpmdiff shedule message to UMB\\n      MessageBus::UmbMessage::ErrataRpmdiffScheduleMessage.new(errata, brew_build, baseline_brew_build, \\\"\\\").enqueue\\n    end\\n  end\\n\\n  def self.get_latest_old_build(old_builds)\\n    old_builds.sort_by{|b| b[:old_build].id}.last[:old_build]\\n  end\\n\\n  def self.find_prior_rpmdiff_run(errata, release_version, brew_build)\\n    runs = ExternalTestRun.joins(:external_test_type)\\\\\\n      .where({\\n        :external_test_type_id => ExternalTestType.find_by_name(\\\"covscan\\\").id,\\n        :errata_id => errata\\n      })\\\\\\n      .where(\'brew_build_id < ?\', brew_build.id)\\\\\\n      .order(\'id desc\')\\n    runs.select {| run | run.get_errata_brew_mapping.release_version.id = release_version.id }.first\\n  end\\n\\nend\\n\\n\\n\",\"attribs\":\"*0|2c+29b|1+1\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.3y5Xi9jHVYSqllix\"]},\"nextNum\":1},\"head\":137,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:RPMDIFF_ET:revs:0','{\"changeset\":\"Z:1>6k|5+6k$Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\",\"meta\":{\"author\":\"\",\"timestamp\":1504861843580,\"atext\":{\"text\":\"Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This a