_version, brew_build)\\n    puts \\\"is there a prior : #{prior.inspect}\\\"\\n    if prior.present?\\n      return prior.brew_build\\n    end\\n\\n    if errata.is_pdc?\\n      old_build = PdcReleasedPackage.latest_released_brew_build_for_build_mapping(mapping)\\n    else\\n      old_build = ReleasedPackage.latest_released_brew_build_for_build_mapping(mapping)\\n    end\\n    puts \\\"is there an old_build : #{old_build}\\\"\\n    old_build\\n  end\\n\\n  def self.schedule_run_for_candidates(errata, brew_build, run_attributes, who)\\n    run_attributes.each do |run|\\n\\n      release_version = run[:release_version]\\n      baseline_brew_build = run[:baseline_brew_build]\\n\\n      puts \\\"#{run[:release_version].name}<<|>>#{brew_build}\\\"\\n\\n      #next if is_existing_run?(errata, brew_build, baseline_brew_build)\\n      existing_runs = existing_runs(errata, brew_build, baseline_brew_build)\\n      if existing_runs.any?\\n        update_run_release_version(existing_runs, release_version)\\n        next\\n      end\\n      new_test_run = errata.create_external_test_run_for(:rpmdiff,\\n                                                         :brew_build_id => brew_build.id,\\n                                                         :baseline_brew_build_id => baseline_brew_build.nil?? nil : baseline_brew_build.id,\\n                                                         :person => who,\\n                                                         :external_data => {\\\"release_version\\\" => [release_version.id]})\\n      puts \\\"run added for PV #{run[:release_version].name}\\\"\\n      # Send rpmdiff shedule message to UMB\\n      MessageBus::UmbMessage::ErrataRpmdiffScheduleMessage.new(errata, brew_build, baseline_brew_build, who).enqueue\\n    end\\n  end\\n\\n  def self.update_run_release_version(existing_runs, release_version)\\n    existing_runs.each do |existing_run|\\n      db_run = ExternalTestRun.find(existing_run.id)\\n      db_run.external_data[\\\"release_version\\\"] << release_version.id unless db_run.external_data[\\\"release_version\\\"].include?release_version.id\\n      db_run.save!\\n    end\\n  end\\n\\n  def self.existing_runs(errata, brew_build, baseline_brew_build)\\n    baseline_condition = baseline_brew_build.nil?? \\\"baseline_brew_build_id is NULL\\\" : \\\"baseline_brew_build_id = #{baseline_brew_build.id}\\\"\\n    puts \\\"baseline condition: #{baseline_condition}\\\"\\n    runs = ExternalTestRun.joins(:external_test_type)\\\\\\n      .where({\\n        :external_test_type_id => ExternalTestType.find_by_name(\\\"rpmdiff\\\").id,\\n        :errata_id => errata\\n      })\\\\\\n      .where(\'brew_build_id = ?\', brew_build.id)\\\\\\n      .where(baseline_condition)\\n    puts \\\"is there any existing runs: #{runs.count}\\\"\\n    return runs\\n    #return runs.any?\\n  end\\n\\n  def self.find_prior_rpmdiff_run(errata, release_version, brew_build)\\n    runs = ExternalTestRun.joins(:external_test_type)\\\\\\n      .where({\\n        :external_test_type_id => ExternalTestType.find_by_name(\\\"rpmdiff\\\").id,\\n        :errata_id => errata\\n      })\\\\\\n      .where(\'brew_build_id < ?\', brew_build.id)\\\\\\n      .where(\'status in (?)\', ExternalTestRun.passing_statuses)\\\\\\n      .order(\'id desc\')\\n    runs.select {|run|\\n      run.external_data[\\\"release_version\\\"].include?(release_version.id) &&\\n      run.get_errata_brew_mapping.package.id == brew_build.package.id\\n    }.first\\n  end\\n\\nend\\n\",\"attribs\":\"*0|2u+35c*0+3|1+1\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.3KxpMzHhwpkMK8tR\"]},\"nextNum\":1},\"head\":1,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:RPMDIFF_RELEASE_VERSION:revs:0','{\"changeset\":\"Z:1>6k|5+6k$Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on 