.start_with? (\'[PDC]\')\\n      puts \\\"- Bug #{bug[\'id\']} #{bug[\'summary\']}\\\"\\n    end\\n  end\\n  ===========================\\n\\n- Bug 1460751 CPE list incomplete\\n- Bug 1458120 Convert UMB message bodies to text/json\\n- Bug 1457627 Embargoed advisories should have information redacted on UMB when status updated\\n- Bug 1455615 Support new LightBlue schema for containerImage entity\\n- Bug 1455090 Re-schedule CCAT test should send message to UMB\\n- Bug 1451560 ErrataPush.get_mapped_variants should fetch variants from both channels and cdn_repos\\n- Bug 1447679 [MX] Cannot copy list of changed rpms in container comparison\\n- Bug 1439456 [ansible] Source script/bash_utils.sh via /etc/profile.d\\n- Bug 1434195 Use more appropriate default errata_status for nochannel /api/v1/push\\n- Bug 1428742 Inactive multi-product mappings should consider both the dist\'s original PV and related links\\n- Bug 1427422 Migrate the CCAT listener from Qpid to UMB\\n- Bug 1427421 Migrate the covscan listener from Qpid to UMB\\n- Bug 1425440 Inconsistent platform/affected_cpe_list in OVAL documents\\n- Bug 1405053 ET: Fix CVEs does not work correctly for old advisories\\n- Bug 1391388 Push via API may create duplicate push jobs\\n- Bug 1389666 Remove asset host setting for staging env by default\\n- Bug 1384011 push-to-buildroot: please display pop-up with qa-contact in case that user doesn\'t have rights to perform action\\n- Bug 1373885 Errata API doesn\'t provide way how to get information about variant by ID or by NAME\\n- Bug 1312314 URL routing is not able to match names that contain a \'.\' character\\n- Bug 1285650 [RFE] Provide history and message bus notifications for pushing a batch of advisories\\n- Bug 1276968 [RFE] Send errors to error queue for new message bus\\n- Bug 1101309 [RFE] Allow embargoed errata with no unembargo date\\n\\n\",\"attribs\":\"*0|5+6a*0+6*0*1*2+18*0|r+1bh*0+1r|2+4\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.54BbZnbroMcQsHxr\"],