eate(\\\"https://projects.devel.engineering.redhat.com/rest/api/2/\\\", \\\"wguo\\\",\\n                \\\"redhat\\\");\\n    }\\n\\n    private Issue generateIssue() {\\n        Issue issue = new Issue();\\n        String summary = \\\"JIRA Rest API Test 3\\\";\\n        String description = \\\"description\\\";\\n        Project project = new Project();\\n        project.setKey(\\\"MT\\\");\\n        issue.setProject(project);\\n        issue.setSummary(summary);\\n        issue.setDescription(description);\\n        IssueType issueType = new IssueType();\\n        issueType.setName(\\\"Task\\\");\\n        issue.setIssuetype(issueType);\\n        Component component = new Component();\\n        component.setName(\\\"client\\\");\\n        List<Component> components = new ArrayList<Component>();\\n        components.add(component);\\n        issue.setComponents(components);\\n        return issue;\\n    }\\n\\n    @Test(enabled = false)\\n    public void testCreateIssue() throws Exception {\\n        Issue issue = jiraClient.createIssue(generateIssue());\\n        LOGGER.info(\\\"#{}, key: {}\\\", issue.getId(), issue.getKey());\\n        assertNotNull(issue);\\n    }\\n\\n    @Test(enabled = false)\\n    public void testGetIssue() throws Exception {\\n        Set<Issue> issues = jiraClient.getIssuesByIds(Arrays.asList(\\\"MT-1\\\"), Arrays.asList(JiraField.STATUS));\\n        for (Issue issue : issues) {\\n            assertEquals(issue.getStatus().getName(), \\\"To Do\\\");\\n        }\\n        assertTrue(issues.size() == 1);\\n    }\\n\\n}\\n\",\"meta\":{\"author\":\"a.aqmWL9r2gCNjVozF\",\"timestamp\":1457414615340}}'),('pad:tmp:revs:8','{\"changeset\":\"Z:1n7>1|2=1a*1|1+1$\\n\",\"meta\":{\"author\":\"a.FGTvxt7hZeBMrZzK\",\"timestamp\":1457579559979}}'),('pad:tmp:revs:9','{\"changeset\":\"Z:1n8>2|3=1b*1|2+2$\\n\\n\",\"meta\":{\"author\":\"a.FGTvxt7hZeBMrZzK\",\"timestamp\":1457579560472}}'),('pad:TPS_ISSUE_DIG','{\"atext\":{\"text\":\"1. select job.version_id