eah, i will consider the previous fix to whether it\'s right for this case\\n<jwl_home> the files in app/models could stand a few more comments, or perhaps some docs (if they don\'t already exist somewhere).\\n<jwl_home> I know how the channels work, but I\'m a bit confused here, too :-(\\n<wguo> k, if the -eus- channel/repo can set be primary, then looks confused me too \\n<jwl_home> \\\"Primary\\\" could be used as \\\"primary (or \'main\')\\\" release.  It could also mean \\\"this has multiple destinations, a primary, and then a secondary.\\\"  But I haven\'t read enough to get the possible contexts as to whether (and why) this is correct, or some misconfiguration.\\n* cmedeiro is now known as cmedeiro_afk\\n<jwl_home> hopefully I\'m just confused because I\'m getting tired :)\\n<wguo> got it, will check it later, thanks jwl_home  : )\\n<jwl_home> good find on the variants/1231 page; didn\'t know one could set the stream there\\n<wguo> yeah, looks all the channels determine the stream depend on the related variant setting \\n* rmcgover|wfh is now known as rmcgover|afk\\n* You are now known as wguo|afk\\n<jwl_home> well, channels belong to a stream on tps-server; makes sense for products/variants to pick it up here.\\n\\n\\n\\n\\n1. The channel whose release type \\\"EUS\\\" & \\\"LongLife\\\" \\nhttps://errata.devel.redhat.com/product_versions/467/cdn_repos/2790\\n2. The channel belonged to zstream product, and the related rhel product version had been disabeld\\nhttps://errata.devel.redhat.com/product_versions/488/cdn_repos/2927\\n3. The channel belonged to eus/aus product \\n\",\"attribs\":\"*0|u+1u1*0+35*1|9+86*1+17|1+1\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.B8LSWovOHf7xqhup\"],\"1\":[\"author\",\"a.ZUveCyNN8nk3wukQ\"]},\"nextNum\":2},\"head\":204,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:TPS_ISSUE_QUESTIONS:revs:0','{\"changeset\":\"Z:1>1x+1x$This a private pad platform which you can record what y