ed queue\\nlogs for received messages:  /var/www/errata_rails/log/messaging_service-mbus.log\\n\\n ================================\\n[2017-07-20 02:23] DEBUG  Received: Message{address=\\\"queue://errata_from_esb\\\", durable=1, ttl=604799980, id=\\\"ID:messaging-devops-router02.web.stage.ext.phx2.redhat.com-34657-1498150890831-3:3:14:1:6\\\",\\n expiry_time=1501122207390, creation_time=1500517407390, annotations={:\\\"x-opt-to-type\\\"=\\\"queue\\\", :\\\"x-opt-jms-dest\\\"=0},  properties={\\\"esbSourceSystem\\\"=\\\"jbossJira\\\", \\\"esbMessageType\\\"=\\\"jbossJiraNotification\\\", \\n\\\"breadcrumbId\\\"=\\\"ID-jira-app-stage-mwc-hst-phx2-redhat-com-42211-1500480968830-0-90\\\",\\\"CamelJmsDeliveryMode\\\"=2}, body=\\\"{\\\"key\\\":\\\"WFK2-891\\\",\\\"id\\\":12630018,\\\"eventTime\\\":\\\"2017-07-20T02:23:27.192+0000\\\"}\\\"}\\n\\n[2017-07-20 02:23] DEBUG  Received: Message{address=\\\"queue://errata_from_esb\\\", durable=1, ttl=604799978, id=\\\"ID:messaging-devops-router01.web.stage.ext.phx2.redhat.com-37175-1498149186424-3:1:1:1:6\\\",\\n expiry_time=1501122230928, creation_time=1500517430928, annotations={:\\\"x-opt-to-type\\\"=\\\"queue\\\", :\\\"x-opt-jms-dest\\\"=0}, properties={\\\"esbSourceSystem\\\"=\\\"jbossJira\\\", \\\"esbMessageType\\\"=\\\"jbossJiraNotification\\\", \\n\\\"breadcrumbId\\\"=\\\"ID-jira-app-stage-mwc-hst-phx2-redhat-com-42211-1500480968830-0-94\\\", \\\"CamelJmsDeliveryMode\\\"=2}, body=\\\"{\\\"key\\\":\\\"WFK2-891\\\",\\\"id\\\":12630018,\\\"eventTime\\\":\\\"2017-07-20T02:23:50.794+0000\\\"}\\\"}\\n\\n[2017-07-20 02:24] DEBUG  Received: Message{address=\\\"queue://errata_from_esb\\\", durable=1, ttl=604799981, id=\\\"ID:messaging-devops-router01.web.stage.ext.phx2.redhat.com-37175-1498149186424-3:2:15:1:4\\\",\\n expiry_time=1501122253654, creation_time=1500517453654, annotations={:\\\"x-opt-to-type\\\"=\\\"queue\\\", :\\\"x-opt-jms-dest\\\"=0}, properties={\\\"esbSourceSystem\\\"=\\\"jbossJira\\\", \\\"esbMessageType\\\"=\\\"jbossJiraNotification\\\", \\n\\\"breadcrumbId\\\"=\\\"ID-jira-app-stage-mwc-hst-phx2-redhat-com-42211-1500480968830-0-98\\\", \\\"CamelJmsDeliveryMode\\\"=2}, body=\\\"{\\\"key\\\":\\\"WFK2-891\\\",\\\"id\\\":12630018,\\\"eventTime\\\":\\\"2017-07-20T02:24:13.476+0000\\\"}\\\"}\\n=============================================================\\n \\n2. [mock other system to omit messages]\\nmostly we don\'t have permission to omit test messages to other topics, that\'s should\\nnot be a big problem, we can create a separate topic under errata parent topic, which is\\nspecifically used for QE team to do some test. What we need to know is the message\\nformat of other systems. \\n\\ntest topic for Bugzilla\\ntopic://VirtualTopic.eng.errata.for-test.bugzilla.bug.change.>\\n\\nupdate subscription address as part 1 mentioned, it should be:\\nqueue://Consumer.client-errata.bzconsumer.VirtualTopic.eng.errata.for-test.bugzilla.bug.change.>\\n\\nrestart the messaging service\\n\\nsend message to test topic and check if we can receive messages from the test queue\\nlogs for received messages:  /var/www/errata_rails/log/messaging_service-mbus.log\\n\\n3 send message to topic\\n\\n\",\"attribs\":\"*0|4+4z*0*2+1g*0|5+2n*0+v*0*2+17*0|b+aj*0*1+28*0|2+2*0*2+2h*0|1+1*0+9*0*2+r*0+5*0*1+28*0+1*0*2+1*0|q+1vt*0+p*0*1+f*0|3+2f*0+1n*0*1+f*0|8+6u|1+1\"},\"pool\":{\"numToAttrib\":{\"0\":[\"author\",\"a.UqJvMI7o2ytxEEOt\"],\"1\":[\"bold\",\"true\"],\"2\":[\"italic\",\"true\"]},\"nextNum\":3},\"head\":966,\"chatHead\":-1,\"publicStatus\":false,\"passwordHash\":null,\"savedRevisions\":[]}'),('pad:umb_for_qe:revs:0','{\"changeset\":\"Z:1>6k|5+6k$Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\",\"meta\":{\"author\":\"\",\"timestamp\":1500528509673,\"atext\":{\"text\":\"Welcome to Etherpad!\\n\\nThis pad text is synchronized as you type, so that everyone viewing this page sees the same text. This allows you to collaborate seamlessly on documents!\\n\\nEtherpad on Github: https://github.com/ether/etherpad-lite\\n\\n\",\"attribs\":\"|6+6l\"}}}'),('pad:umb_for_qe:revs:1','{\"changeset\":\"Z:6l<6j|4-4x-1m$\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1500528513310}}'),('pad:umb_for_qe:revs:10','{\"changeset\":\"Z:c>1=a*0+1$s\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1500528518914}}'),('pad:umb_for_qe:revs:100','{\"changeset\":\"Z:g0>2|e=f4=u*0+2$n \",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1500528803734,\"atext\":{\"text\":\"1. Update subscription address in settings\\ne.g.: :mbus_bugzilla_topic_address\\n\\n# queue names pattern: Consumer.$CLIENT.$CONSUMER_ID.VirtualTopic.$HIERARCHY.$\\n# e.g.:\\n# client name ($CLIENT): client-errata\\n# hierarchy ($HIERARCHY): eng.pub.foo\\n# consumer id ($CONSUMER_ID): fooconsumer\\n# consumer name: Consumer.client-errata.fooconsumer.VirtualTopic.eng.pub.foo\\n# See: https://mojo.redhat.com/docs/DOC-1137709\\n\\nqueue://Consumer.client-errata.bzconsumer.VirtualTopic.eng.bugzilla.bug.change.>\\n\\n2. trigger event to omit message on relevent topic\\nmostly we don\'t have permissoin \\n\\n\",\"attribs\":\"*0|e+f4*0+w|2+2\"}}}'),('pad:umb_for_qe:revs:101','{\"changeset\":\"Z:g2>2|e=f4=w*0+2$to\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1500528804234}}'),('pad:umb_for_qe:revs:102','{\"changeset\":\"Z:g4>1|e=f4=y*0+1$ \",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1500528804734}}'),('pad:umb_for_qe:revs:103','{\"changeset\":\"Z:g5>1|e=f4=z*0+1$t\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1500528807310}}'),('pad:umb_for_qe:revs:104','{\"changeset\":\"Z:g6<1|e=f4=z-1$\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1500528808506}}'),('pad:umb_for_qe:revs:105','{\"changeset\":\"Z:g5>3|e=f4=z*0+3$sen\",\"meta\":{\"author\":\"a.