me ($CLIENT): client-errata\\n# hierarchy ($HIERARCHY): eng.pub.foo\\n# consumer id ($CONSUMER_ID): fooconsumer\\n# consumer name: Consumer.client-errata.fooconsumer.VirtualTopic.eng.pub.foo\\n# See: https://mojo.redhat.com/docs/DOC-1137709\\n\\nqueue://Consumer.client-errata.bzconsumer.VirtualTopic.eng.bugzilla.bug.change.>\\n\\nrestart the messaging service and check if we can receive messages from the updated queue\\n\\nlogs for received messages:  /var/www/errata_rails/log/messaging_service-mbus.log\\n\\n2.[If we want to mock other system to omit messages]\\nmostly we don\'t have permissoin to omit test messages to other topics, that\'s should\\nnot be a big problem, we can create a separate topic under errata parent one, which is\\nspecifically used for qe team to do some test. What we just need to know is the message\\nformat of other systems. \\n\\ntopic://VirtualTopic.eng.errata.for-test.bugzilla.bug.change.>\\n\\n3. update subscription address as step1 mentioned, as we had mock the topic for other system,\\nrestart the messaging service\\n\\nqueue://Consumer.client-errata.bzconsumer.VirtualTopic.eng.errata.for-test.bugzilla.bug.change.>\\n\\n4. send message to test topic\\n\\n\",\"attribs\":\"*0|u+106*0+p*0*1+f*0|5+45*0+1n*0*1+f*0|2+o*0+t|2+2\"}}}'),('pad:umb_for_qe:revs:701','{\"changeset\":\"Z:190>1|7=9d*0|1+1$\\n\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1500530598764}}'),('pad:umb_for_qe:revs:702','{\"changeset\":\"Z:191>1|7=9d*0+1$b\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1500530599954}}'),('pad:umb_for_qe:revs:703','{\"changeset\":\"Z:192>2|7=9d=1*0+2$ug\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1500530600455}}'),('pad:umb_for_qe:revs:704','{\"changeset\":\"Z:194>2|7=9d=3*0+2$zi\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1500530600954}}'),('pad:umb_for_qe:revs:705','{\"changeset\":\"Z:196>1|7=9d=5*0+1$l\",\"meta\":{\"author\":\"a.UqJvMI7o2ytxEEOt\",\"timestamp\":1500530601454}}')